    t[234] = "Note: Your contribution to the network (network share) is determined by the allocation of upstream bandwidth (upload speed).";
    t[235] = "Nota: Sua contribui\u00e7\u00e3o para a rede (compartilhamento de rede) \u00e9 determinada pela aloca\u00e7\u00e3o de largura de banda upstream (velocidade de upload).";
    t[236] = "Advanced Router Configuration";
    t[237] = "Configura\u00e7\u00e3o Avan\u00e7ada do Roteador";
    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "Alocar o n\u00famero de threads do processador para construir t\u00faneis. Se seu processador suporta hiperthreading ou multithreading simult\u00e2neo, voc\u00ea pode multiplicar o n\u00famero de n\u00facleos do processador por 2 para obter o n\u00famero m\u00e1ximo de threads para alocar, caso contr\u00e1rio, o n\u00famero de n\u00facleos do processador = n\u00famero m\u00e1ximo de threads dispon\u00edveis. Observe que voc\u00ea pode desejar alocar menos do que o m\u00e1ximo te\u00f3rico para garantir que tenha espa\u00e7o para outras tarefas.";
