    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Quando um novo t\u00fanel de servi\u00e7o \u00e9 criado ou um servi\u00e7o \u00e9 executado pela primeira vez (por exemplo, o servidor web jetty padr\u00e3o, plugins), uma chave de criptografia privada \u00e9 criada que controla essencialmente a propriedade do endere\u00e7o. Isso geralmente \u00e9 chamado de <code>&hellip;privKey.dat</code> ou <code>eepPriv.dat</code>, embora seja uma boa ideia mudar o nome para indicar o servi\u00e7o a que pertence e depois especific\u00e1-lo nas configura\u00e7\u00f5es do servidor do Gerenciador de T\u00faneis. Este arquivo .dat deve ser guardado em seguran\u00e7a; se voc\u00ea o perder, perder\u00e1 a propriedade e o controle do seu nome de host!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Esta configura\u00e7\u00e3o permite a configura\u00e7\u00e3o do n\u00famero m\u00e1ximo de arquivos por torrent que o I2PSnark permitir\u00e1, ao baixar ou criar um torrente. Observe que aumentar substancialmente esse valor a partir dos 2000 arquivos padr\u00e3o pode exigir uma configura\u00e7\u00e3o adicional no sistema hospedeiro para aumentar o n\u00famero m\u00e1ximo de arquivos abertos permitidos pelo sistema operacional (por exemplo, <code>ulimit -n</code> no Linux). Para alterar, adicione ao arquivo de configura\u00e7\u00e3o do I2PSnark <code>i2psnark.config</code>. [Rein\u00edcio do I2PSnark ou do roteador necess\u00e1rio]";
    t[370] = "Configure router bandwidth allocation";
