    t[372] = "Here are some other public addressbook subscription links. You may wish to add one or two to your <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns subscription list</a>. In the event that addresses conflict in the subscriptions, the lists placed at the top of your susidns configuration will take precedence over those placed further down.";
    t[373] = "Aqui est\u00e3o alguns outros links de assinatura de livros de endere\u00e7os p\u00fablicos. Voc\u00ea pode querer adicionar um ou dois \u00e0 sua <a href='/dns?subscriptions' target=_blank rel=noreferrer>lista de assinaturas susidns</a>. No caso de endere\u00e7os entrarem em conflito nas assinaturas, as listas colocadas no topo da configura\u00e7\u00e3o do susidns ter\u00e3o prioridade sobre as que foram colocadas mais abaixo.";
