    t[554] = "Choose a name for your website (<i>hostname</i>.i2p), using lower-case. To verify that the hostname is available, check <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> or <a href=http://reg.i2p target=_blank>reg.i2p</a> before you decide. Enter the new name for your website on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> where it says <i>Website name</i>, replacing the default <i>mysite.i2p</i> placeholder. If you want your website to be available when I2P starts, enable <i>Auto Start</i> and then click <i>Save</i>.";
    t[555] = "Escolha um nome para o seu website (<i>hostname</i>.i2p), usando letras min\u00fasculas. Para verificar se o nome do host est\u00e1 dispon\u00edvel, verifique <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> ou <a href=http://reg.i2p target=_blank>reg.i2p</a> antes de decidir. Insira o novo nome para o seu website na <a href='/i2ptunnel/edit?tunnel=3'>p\u00e1gina de configura\u00e7\u00e3o do Gerenciador de T\u00faneis</a> onde diz <i>Nome do website</i>, substituindo o valor padr\u00e3o <i>mysite.i2p</i>. Se voc\u00ea deseja que o seu website esteja dispon\u00edvel quando o I2P inicia, habilite <i>Inicializa\u00e7\u00e3o Autom\u00e1tica</i> e clique em <i>Salvar</i>.";
    t[556] = "When set to true, this enables gzip compression for the router console and default web applications. [Enabled by default]";
