    t[615] = "Marque a caixa marcada <i>Proxy DNS ao usar SOCKS v5</i> para evitar vazamentos de DNS.";
    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "Os b\u00f4nus podem ser positivos ou negativos e afetam a inclus\u00e3o do par em camadas r\u00e1pidas e de alta capacidade. Os colegas r\u00e1pidos s\u00e3o usados para t\u00faneis de clientes e os pares de alta capacidade s\u00e3o usados para alguns t\u00faneis explorat\u00f3rios.";
    t[618] = "Yes";
    t[619] = "Sim";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "I2P funcionar\u00e1 adequadamente nesta configura\u00e7\u00e3o, mas se realmente tens mais de 128KBps de transmiss\u00e3o de dados para compartilhar, ser\u00e1 uma ajuda muito maior se fizeres uma abertura na parede de fogo.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "Um aplicativo de linha de comando fornecido com o I2P que \u00e9 usado para solicitar recursos de URL, semelhante ao <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget tamb\u00e9m \u00e9 usado internamente pelo roteador, por exemplo, para reembalar de hosts remotos. Por padr\u00e3o, eepget usa o proxy HTTP em <code>127.0.0.1:4444</code>.";
