    t[722] = "Javadocs";
    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Um eepsite \u00e9 um site que \u00e9 hospedado anonimamente na rede I2P - voc\u00ea pode acess\u00e1-lo configurando o seu navegador para usar o proxy HTTP do I2P (veja acima) e navegando at\u00e9 o site com sufixo <code>.i2p</code> (por exemplo, <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Certifique-se tamb\u00e9m de que o seu navegador est\u00e1 configurado para resolver DNS remotamente ao usar o proxy, a fim de evitar vazamentos de DNS.";
    t[730] = "Updating UDP port to {0}";
