    t[733] = "Guia de seguran\u00e7a do servidor Web Apache";
    t[736] = "Locate the configuration file: <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> in the <code>clients.config.d</code> folder in your I2P settings directory, and then edit accordingly:";
    t[737] = "Localize o arquivo de configura\u00e7\u00e3o: <code>00-net.i2p.router.web.routerconsolerunner-clients.config</code> na pasta <code>clients.config.d</code> no seu diret\u00f3rio I2P, e depois Editar de acordo:";
