    t[833] = "Execute a an\u00e1lise em todos os roteadores no NetDb";
    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "O primeiro n\u00famero \u00e9 o n\u00famero de peers dos quais o seu roteador enviou ou recebeu uma mensagem nos \u00faltimos minutos. Isso pode variar de 8 a 10 a v\u00e1rias centenas, dependendo da largura de banda total, da largura de banda compartilhada e do tr\u00e1fego gerado localmente. O segundo n\u00famero \u00e9 o n\u00famero de peers vistos na \u00faltima hora aproximadamente. N\u00e3o se preocupe se esses n\u00fameros variarem amplamente. <a href='/configstats#router.activePeers'>[Ativar gr\u00e1ficos]</a>.";
    t[838] = "This file should be used only for a very limited number of friends (less than 3).";
