    t[878] = "This setting permits disabling SSU tests to determine if your router is firewalled and can be enabled for routers that are definitely not firewalled but are experiencing intermittent firewalling issues. In the event that testing is disabled, both SSU and NTCP should report your current public ip address on <a href=/info>the router info page</a>. [Restart required]";
    t[879] = "Essa configura\u00e7\u00e3o permite desabilitar os testes SSU para determinar se o seu roteador est\u00e1 com firewall e pode ser habilitado para roteadores que definitivamente n\u00e3o est\u00e3o com firewall, mas est\u00e3o enfrentando problemas intermitentes de firewall. No caso de os testes serem desabilitados, tanto SSU quanto NTCP devem relatar seu endere\u00e7o IP p\u00fablico atual na <a href=/info>p\u00e1gina de informa\u00e7\u00f5es do roteador</a>. [Reinicializa\u00e7\u00e3o necess\u00e1ria]";
