    t[976] = "Externally reachable hostname or IP address";
    t[977] = "Endere\u00e7o IP ou nome em rede alcan\u00e7\u00e1vel externamente";
    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "O seu servidor web est\u00e1 funcionando por padr\u00e3o em <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, mas n\u00e3o \u00e9 acess\u00edvel por outras pessoas at\u00e9 voc\u00ea iniciar o t\u00fanel <i>I2P Webserver</i>. Ap\u00f3s iniciar o t\u00fanel, seu site ser\u00e1 dif\u00edcil de ser encontrado por outras pessoas. Voc\u00ea poderia informar apenas o destino ou o endere\u00e7o Base32, mas felizmente o I2P tem uma agenda para armazenar nomes de dom\u00ednio, e v\u00e1rios servi\u00e7os onde voc\u00ea pode <a href=/help/hostnameregistration>registrar um novo dom\u00ednio .i2p</a> gratuitamente.";
    t[984] = "Major Sybil Warning - above router is closer than average minimum distance";
