    t[1002] = "When set to false, the router will not throttle tunnel build requests from other routers, and should be used with caution. [Default is true, restart required]";
    t[1003] = "Quando definido como falso, o roteador n\u00e3o limitar\u00e1 as solicita\u00e7\u00f5es de constru\u00e7\u00e3o de t\u00faneis de outros roteadores e deve ser usado com cuidado. [Por padr\u00e3o \u00e9 verdadeiro, reinicializa\u00e7\u00e3o necess\u00e1ria]";
