    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "A menos que um outproxy tenha sido configurado para o servi\u00e7o ao qual voc\u00ea deseja se conectar, isso n\u00e3o \u00e9 poss\u00edvel, com exce\u00e7\u00e3o do BitTorrent (ver abaixo). Atualmente, existem apenas tr\u00eas tipos de outproxies em execu\u00e7\u00e3o: HTTP, HTTPS e e-mail. Observe que atualmente n\u00e3o h\u00e1 um SOCKS outproxy publicamente listado. Se esse tipo de servi\u00e7o for necess\u00e1rio, experimente <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
