    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "O deslocamento (offset) do rel\u00f3gio do seu computador em rela\u00e7\u00e3o ao tempo sincronizado da rede (se conhecido). O I2P requer que a hora do seu computador esteja correta. Se o deslocamento for superior a alguns segundos, corrija o problema ajustando a hora do seu computador. Se o I2P n\u00e3o conseguir se conectar \u00e0 internet, pode ser indicada uma leitura de 0ms. Observa\u00e7\u00e3o: Isso \u00e9 exibido apenas na se\u00e7\u00e3o <i>Informa\u00e7\u00f5es do roteador (avan\u00e7ado)</i>. Voc\u00ea pode adicionar esta se\u00e7\u00e3o \u00e0 sua barra lateral na p\u00e1gina de <a href='/configsidebar'>Configura\u00e7\u00e3o da barra lateral</a>.";
