    t[1272] = "To migrate the key to a new router, or to setup multihoming (running the same service on multiple routers for redundancy and load-balancing), copy the backed up key to your .i2p directory and specify it in the new server tunnel, or replace the default key in the plugin folder (e.g. the zzzot plugin).";
    t[1273] = "Para migrar a chave para um novo roteador ou configurar o multihoming (executando o mesmo servi\u00e7o em v\u00e1rios roteadores para redund\u00e2ncia e balanceamento de carga), copie a chave de backup para o seu diret\u00f3rio .i2p e especifique-a no novo t\u00fanel do servidor, ou substitua a chave padr\u00e3o na pasta do plugin (por exemplo, o plugin zzzot).";
