    t[1462] = "How long an outbound message waits in the queue. This should generally be a few hundred milliseconds or less. If it is consistently higher than 1000ms, your computer is very slow, or you should adjust your bandwidth limits, or your (BitTorrent?) clients may be sending too much data and should have their transmit bandwidth limit reduced. <a href='/configstats#transport.sendProcessingTime'>[Enable graphing]</a> (transport.sendProcessingTime).";
    t[1463] = "Por quanto tempo uma mensagem de sa\u00edda espera na fila. Geralmente, isso deve ser alguns poucos centenas de milissegundos ou menos. Se estiver consistentemente acima de 1000ms, seu computador est\u00e1 muito lento ou voc\u00ea deve ajustar os limites de largura de banda ou seus clientes (BitTorrent?) podem estar enviando muitos dados e deveriam ter seu limite de largura de banda de transmiss\u00e3o reduzido. <a href='/configstats#transport.sendProcessingTime'>[Ativar a exibi\u00e7\u00e3o de gr\u00e1ficos]</a> (transport.sendProcessingTime).";
