    t[2207] = "Vers\u00e3o";
    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "O I2P seleciona uma porta aleat\u00f3ria entre 9000 e 31000 para se comunicar com outros roteadores quando o programa \u00e9 executado pela primeira vez, ou quando o endere\u00e7o IP externo muda ao executar no <a href=/confignet#ipchange>Modo Laptop</a>. A <a href=/confignet#udpconfig>porta selecionada</a> \u00e9 mostrada na <a href=/confignet>p\u00e1gina de Configura\u00e7\u00e3o da Rede</a>.";
