    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "Levar\u00e1 pelo menos 10 minutos a partir do in\u00edcio do seu roteador para aceitar a constru\u00e7\u00e3o de t\u00faneis participantes, a fim de garantir que seu roteador esteja est\u00e1vel e tenha sido inicializado com \u00eaxito na rede.";
    t[2234] = "Last Heard From";
    t[2235] = "\u00daltima vez de";
    t[2236] = "midnight";
    t[2237] = "meia-noite";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "Uma introdu\u00e7\u00e3o gentil ao I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Por quanto tempo os trabalhos est\u00e3o esperando antes da execu\u00e7\u00e3o. A fila de trabalhos est\u00e1 listada na <a href='/jobs'>p\u00e1gina de Trabalhos</a>. Infelizmente, existem v\u00e1rias outras filas de trabalhos no roteador que podem estar congestionadas e seu status n\u00e3o est\u00e1 dispon\u00edvel no console do roteador. O atraso do trabalho deve ser geralmente zero. Se estiver consistentemente acima de 500ms, seu computador est\u00e1 muito lento, sua rede est\u00e1 enfrentando problemas de conectividade ou o roteador tem problemas graves. <a href='/configstats#jobQueue.jobLag'>[Ativar a exibi\u00e7\u00e3o de gr\u00e1ficos]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Configurar atualiza\u00e7\u00f5es I2P";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Antes de contar ao mundo sobre o seu novo site, voc\u00ea precisa adicionar algum conte\u00fado. V\u00e1 para o diret\u00f3rio raiz do servidor <a href=#rootdir>listado acima</a> e substitua a p\u00e1gina de redirecionamento <i>index.html</i> com seu pr\u00f3prio conte\u00fado. Se voc\u00ea precisa de um modelo para um site b\u00e1sico, fique \u00e0 vontade para adaptar <a href=http://127.0.0.1:7658/help/pagetemplate.html>esta p\u00e1gina</a>. Se voc\u00ea voltar para esta p\u00e1gina ap\u00f3s editar o conte\u00fado, tente limpar o cache web do seu navegador.";
