    t[2294] = "The <i class=example>default</i> threshold applies to any remote destination not explicitly listed in the definition or in any of the referenced files. To set a default threshold use the keyword <i class=example>default</i>.";
    t[2295] = "O limite <i class=example>default</i> se aplica a qualquer destino remoto que n\u00e3o esteja explicitamente listado na defini\u00e7\u00e3o ou em nenhum dos arquivos referenciados. Para definir um limite padr\u00e3o, use a palavra-chave <i class=example>default</i>.";
