    t[2310] = "Send on";
    t[2311] = "Enviado em";
    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Se o seu roteador tiver 10 ou mais peers ativos, est\u00e1 tudo bem. O roteador deve manter conex\u00f5es com alguns peers o tempo todo. A melhor maneira de se manter \"melhor conectado\" \u00e0 rede \u00e9 <a href=/config>compartilhar mais largura de banda</a>.";
