    t[2365] = "Algumas indica\u00e7\u00f5es b\u00e1sicas de sobrecarga do roteador:";
    t[2370] = "Glossary";
    t[2371] = "Gloss\u00e1rio";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Para obter seu pr\u00f3prio nome de host, registradores de dom\u00ednio I2P como <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> ou <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> fornecem servi\u00e7os de registro que permitem registrar e gerenciar um nome de host ou subdom\u00ednio .i2p que depois ser\u00e1 propagado pela rede. Alguns sites de registro exigir\u00e3o o <i>endere\u00e7o de destino B64</i> para o t\u00fanel/servi\u00e7o que voc\u00ea deseja associar a um nome de host, que voc\u00ea deve copiar na se\u00e7\u00e3o <i>Destino Local</i> da <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>p\u00e1gina de configura\u00e7\u00e3o do Gerenciador de T\u00faneis</a>.";
