    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Isso indica a quantidade de RAM que o I2P est\u00e1 usando e a quantidade total dispon\u00edvel, alocada pelo Java. Se o uso for consistentemente alto em rela\u00e7\u00e3o \u00e0 RAM dispon\u00edvel, isso pode indicar que voc\u00ea precisa aumentar a RAM alocada para o JVM. Voc\u00ea pode alocar mais RAM editando o arquivo <code>wrapper.config</code>, que normalmente est\u00e1 localizado no diret\u00f3rio de aplicativos do I2P. Voc\u00ea precisar\u00e1 editar o par\u00e2metro <code>wrapper.java.maxmemory</code>, que por padr\u00e3o est\u00e1 definido como 256 (MB) para o I2P, ou 384 para o I2P+. Observa\u00e7\u00e3o: se a barra de mem\u00f3ria estiver habilitada, a entrada de mem\u00f3ria na se\u00e7\u00e3o de informa\u00e7\u00f5es do roteador ser\u00e1 suprimida.";
