    t[2501] = "Introdu\u00e7\u00e3o ao I2P";
    t[2502] = "Update available";
    t[2503] = "Actualiza\u00e7\u00e3o dispon\u00edvel.";
    t[2504] = "Close to our destinations";
    t[2505] = "Perto dos nossos destinos";
    t[2506] = "Restart required to activate family {0}.";
    t[2507] = "\u00c9 necess\u00e1rio reiniciar para ativar a fam\u00edlia {0}.";
    t[2508] = "PERFORMANCE WARNING - Settings include very long tunnels.";
    t[2509] = "AVISO DE DESEMPENHO - As configura\u00e7\u00f5es incluem t\u00faneis muito longos.";
    t[2518] = "Network error";
    t[2519] = "Erro de rede";
    t[2520] = "Advanced Configuration Help";
    t[2521] = "Ajuda de configura\u00e7\u00e3o avan\u00e7ada";
    t[2530] = "In / Out";
    t[2531] = "Entrada/Sa\u00edda";
    t[2536] = "Under <i>Configure Proxy Access to Internet</i> select the <i>Manual proxy configuration</i> option.";
    t[2537] = "Em <i>Configurar acesso proxy \u00e0 Internet</i> selecione a op\u00e7\u00e3o <i>Configura\u00e7\u00e3o manual de proxy</i>.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Para servir seu pr\u00f3prio conte\u00fado est\u00e1tico, voc\u00ea s\u00f3 precisa editar ou substituir os arquivos no diret\u00f3rio raiz do servidor da web, e o site estar\u00e1 dispon\u00edvel na rede I2P depois de seguir as instru\u00e7\u00f5es abaixo. Al\u00e9m disso, scripts cgi e python podem ser executados no diret\u00f3rio <code>cgi-bin</code> imediatamente acima de <code>docroot</code> se voc\u00ea tiver o <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> e <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> instalados.";
    t[2542] = "transit";
    t[2543] = "tr\u00e2nsito";
    t[2550] = "KBps In";
    t[2551] = "KBps entrando";
    t[2556] = "We offered to introduce them";
    t[2557] = "Oferecemos-nos para os apresentar";
    t[2562] = "Troubleshoot";
    t[2563] = "Solu\u00e7\u00e3o de problemas";
    t[2566] = "How long we've been running for this session";
    t[2567] = "Tempo de dura\u00e7\u00e3o desta sess\u00e3o";
    t[2568] = "Jars";
    t[2569] = "Frascos";
    t[2572] = "Plugin will be installed on next restart.";
    t[2573] = "Extens\u00e3o ser\u00e1 instalada no pr\u00f3ximo reinicio.";
    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Muitas das estat\u00edsticas na barra lateral podem ser <a href='/configstats'>configuradas</a> para serem <a href='/graphs'>visualizadas em forma de gr\u00e1fico</a> para an\u00e1lise adicional. Voc\u00ea tamb\u00e9m pode personalizar as se\u00e7\u00f5es que aparecem na barra lateral e sua posi\u00e7\u00e3o na <a href='/configsidebar'>p\u00e1gina de configura\u00e7\u00e3o da barra lateral</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Esta configura\u00e7\u00e3o espec\u00edfica do t\u00fanel permite ativar ou desativar respostas a pings enviados para servidores hospedados pelo roteador. Para desativar os pings, voc\u00ea deve adicionar a linha <code>i2p.streaming.answerPings=false</code> na se\u00e7\u00e3o <i>Op\u00e7\u00f5es Personalizadas</i> da configura\u00e7\u00e3o do servidor no Gerenciador de T\u00faneis.";
    t[2592] = "Max";
    t[2593] = "M\u00e1ximo";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Se voc\u00ea deseja instalar atualiza\u00e7\u00f5es I2P sem assinatura (.zip), isso deve ser adicionado ao arquivo <code>router.config</code>, a menos que voc\u00ea j\u00e1 tenha configurado <code>routerconsole.advanced=true</code>, caso em que essa op\u00e7\u00e3o j\u00e1 \u00e9 fornecida. Nota: desde o I2P+ 0.9.48+, a instala\u00e7\u00e3o de <a href=/configupdate#i2pupdates>atualiza\u00e7\u00f5es sem assinatura</a> est\u00e1 habilitada por padr\u00e3o.";
    t[2600] = "Plugin {0} installed";
    t[2601] = "Extens\u00e3o {0} instalada";
    t[2604] = "I2P requires at least 12KBps to enable sharing. ";
    t[2605] = "I2P requer pelo menos 12KBps para habilitar compartilhamento.";
    t[2608] = "The current external IP address reported by UPnP is {0}";
    t[2609] = "O endere\u00e7o IP externo informado pelo UPnP \u00e9 {0}";
    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "Se voc\u00ea conhece e confia em algu\u00e9m que utiliza o I2P, pe\u00e7a para que eles enviem um arquivo de reseed gerado usando esta p\u00e1gina em seu console do roteador. Em seguida, selecione a op\u00e7\u00e3o <i>Reseed a partir do arquivo</i> no {0} utilizando o arquivo recebido.";
    t[2620] = "To enable session-only changes to the client tunnels, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
    t[2621] = "Para ativar altera\u00e7\u00f5es somente de sess\u00e3o nos t\u00faneis do cliente, ative o <a href=/help/advancedsettings>modo avan\u00e7ado</a> do console.";
    t[2624] = "Standard Java installation";
    t[2625] = "Instala\u00e7\u00e3o Java padr\u00e3o";
    t[2632] = "graph";
    t[2633] = "gr\u00e1fico";
    t[2634] = "I2P Client Protocol port";
    t[2635] = "Porta do Protocolo do Cliente I2P";
    t[2638] = "Recent I2P+ Changes";
    t[2639] = "Mudan\u00e7as recentes de I2P";
    t[2642] = "Bandwidth Graph";
    t[2643] = "Gr\u00e1fico de Banda";
    t[2654] = "Manage your I2P hosts file here (I2P domain name resolution)";
    t[2655] = "Gerenciar o seu arquivo de hosts I2P aqui (resolu\u00e7\u00e3o de nomes de dom\u00ednio I2P)";
    t[2656] = "Estimated total floodfills";
    t[2657] = "Total estimado de inunda\u00e7\u00f5es";
    t[2658] = "Show systray icon";
    t[2659] = "\u00cdcone da bandeja do sistema";
    t[2660] = "Exploratory";
    t[2661] = "Exploradores";
    t[2664] = "Same IPv6 /48 as us";
    t[2665] = "Mesmo IPv6/48 que n\u00f3s";
    t[2670] = "Or to deny all unspecified destinations:";
    t[2671] = "Ou para negar todos os destinos n\u00e3o especificados:";
    t[2672] = "Peers we've been talking to in the last minute / last hour";
    t[2673] = "Pares que estivemos conversando nos \u00faltimos minutos ou na \u00faltima hora";
    t[2676] = "Open console on startup";
    t[2677] = "Abra o console na inicializa\u00e7\u00e3o";
    t[2680] = "Review possible sybils in network database";
    t[2681] = "Revise poss\u00edveis sibilas no banco de dados da rede";
    t[2682] = "WAN Ethernet Link Configuration";
    t[2683] = "Configura\u00e7\u00e3o link ethernet WAN";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Esta configura\u00e7\u00e3o (em segundos) permite substituir o atraso entre as execu\u00e7\u00f5es do Job de Explora\u00e7\u00e3o de Pares, que tenta localizar novos pares para adicionar ao NetDb. O trabalho ser\u00e1 executado a cada 80 segundos por padr\u00e3o, ou, se o enrutador estiver enfrentando atraso no trabalho ou nas mensagens, a cada 3 minutos. Se o tamanho do NetDb atingir 4000 pares, a pausa aumentar\u00e1 para 15 minutos. Pode ser necess\u00e1rio aumentar o atraso se o NetDb estiver bem-populado (mais de 2000 pares) ou se voc\u00ea quiser reduzir o uso geral da largura de banda. Observa\u00e7\u00e3o: para enrutadores Floodfill, esse trabalho n\u00e3o \u00e9 executado.";
    t[2698] = "Current";
    t[2699] = "Atual";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Um site hospedado na rede I2P. Por padr\u00e3o, um <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>servidor web Jetty</a> est\u00e1 configurado e em execu\u00e7\u00e3o em <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Pode ser desativado ou alterado no <a href=/i2ptunnelmgr>Gestor de T\u00faneis</a>. Tamb\u00e9m pode ser configurado para ligar a uma interface espec\u00edfica ou a todas as interfaces.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "Servi\u00e7o I2P agora habilitado na inicializa\u00e7\u00e3o do sistema";
    t[2748] = "Computer related news aggregation";
    t[2749] = "Agrega\u00e7\u00e3o de not\u00edcias relacionadas a inform\u00e1tica";
    t[2752] = "Same IP as us";
    t[2753] = "Mesmo IP que n\u00f3s";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Voc\u00ea pode criar uma nova fam\u00edlia de roteador aqui. Depois de criar a fam\u00edlia, voc\u00ea pode exportar o arquivo -chave da fam\u00edlia e compartilhar com outros roteadores em sua fam\u00edlia indicada.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "O par de t\u00faneis concordou em participar";
    t[2758] = "Advanced Lookup";
    t[2759] = "Pesquisa Avan\u00e7ada";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Para acessar sites hospedados na I2P e, opcionalmente, usar o outproxy padr\u00e3o para se conectar a sites na clearnet, voc\u00ea precisar\u00e1 configurar seu navegador para usar o proxy HTTP I2P, que por padr\u00e3o roda em <code>127.0.0.1 porta 4444</code>. A maioria dos navegadores oferece uma op\u00e7\u00e3o para configurar seu proxy; neste mini-tutorial, vamos nos concentrar no Firefox.";
    t[2776] = "Close to us";
    t[2777] = "Perto de n\u00f3s";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "Mapa do site do roteador I2P";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "A extens\u00e3o descarregada {0} n\u00e3o \u00e9 mais recente que a extens\u00e3o instalada";
    t[2796] = "Streaming radio service";
    t[2797] = "Servi\u00e7o de streaming de r\u00e1dio";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "O I2P+ funciona melhor quando voc\u00ea pode refletir com precis\u00e3o a velocidade da sua conex\u00e3o de rede na se\u00e7\u00e3o de configura\u00e7\u00e3o de largura de banda. Por padr\u00e3o, o I2P+ \u00e9 configurado com alguns valores bastante conservadores que n\u00e3o se adequar\u00e3o a muitos casos de uso, portanto, reserve um tempo para revisar essas configura\u00e7\u00f5es e corrigir onde necess\u00e1rio. Quanto mais largura de banda voc\u00ea alocar, <i>especificamente</i> a largura de banda de upload, mais voc\u00ea se beneficiar\u00e1 da rede.";
    t[2810] = "Transit by Peer";
    t[2811] = "Tr\u00e2nsito por ponto";
    t[2812] = "Hidden Mode";
    t[2813] = "Modo Oculto";
    t[2814] = "Plugin requires Jetty version {0} or lower";
    t[2815] = "Extens\u00e3o requer Jetty vers\u00e3o {0} ou superior";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "O proxy pode ser hospedado remotamente ou um servi\u00e7o em execu\u00e7\u00e3o em seu computador (localhost/127.0.0.1).";
    t[2824] = "Events in peak period";
    t[2825] = "Eventos no per\u00edodo de pico";
    t[2838] = "Router Console &amp; WebApps Display Language";
    t[2839] = "Console de roteador e linguagem de exibi\u00e7\u00e3o de WebApps";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "O que fazer caso o I2P+ n\u00e3o esteja funcionando";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "AVISO ANONIMATO - As configura\u00e7\u00f5es incluem 1- hop t\u00faneis.";
    t[2858] = "I2P IRC Network";
    t[2859] = "Rede I2P IRC";
    t[2864] = "pixels wide";
    t[2865] = "pixels de largura";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "O Protocolo de Rede I2P (I2NP) gerencia o roteamento e a mistura de mensagens entre roteadores, al\u00e9m da sele\u00e7\u00e3o do transporte (quando mais de um \u00e9 suportado) ao se comunicar com um par. Para mais informa\u00e7\u00f5es, consulte a <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>documenta\u00e7\u00e3o online</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Expirado {0} atr\u00e1s";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "O status do seu roteador em aceitar ou rejeitar solicita\u00e7\u00f5es de outros roteadores para construir um t\u00fanel participante atrav\u00e9s do seu roteador. Seu roteador pode aceitar todas as solicita\u00e7\u00f5es, aceitar ou rejeitar uma porcentagem das solicita\u00e7\u00f5es ou rejeitar todas as solicita\u00e7\u00f5es por v\u00e1rios motivos, para controlar a demanda de largura de banda e CPU e manter a capacidade para os clientes locais. <b>Observe";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Por favor, entre em contato com um amigo conhecido e confi\u00e1vel que tenha um roteador I2P em execu\u00e7\u00e3o e pe\u00e7a ajuda para reabastecer o seu roteador I2P. Solicite que ele envie um arquivo de reabastecimento exportado do roteador I2P em execu\u00e7\u00e3o dele. \u00c9 vital que o arquivo seja trocado por um canal seguro, por exemplo, criptografado para evitar adultera\u00e7\u00f5es externas (assinado, criptografado e verificado com uma chave p\u00fablica confi\u00e1vel). O arquivo em si n\u00e3o \u00e9 assinado, portanto, aceite apenas arquivos de amigos confi\u00e1veis conhecidos. Nunca importe um arquivo de reabastecimento se voc\u00ea n\u00e3o puder verificar a sua origem.";
    t[2916] = "Last Good Send";
    t[2917] = "\u00daltimo envio OK";
    t[2918] = "Delete this value to disable";
    t[2919] = "Exclua este valor para desabilitar";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Voc\u00ea pode usar um gravador em um t\u00fanel que grava em um arquivo que outro t\u00fanel, ou v\u00e1rios t\u00faneis, podem usar para limita\u00e7\u00e3o. Esses arquivos tamb\u00e9m podem ser editados manualmente.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "Roteador executando uma vers\u00e3o emulada por software n\u00e3o nativo da biblioteca Java BigInteger";
    t[2928] = "Country";
    t[2929] = "Pa\u00eds";
    t[2934] = "Peer's clockskew relative to our clock";
    t[2935] = "Desvio do rel\u00f3gio do par em rela\u00e7\u00e3o ao nosso rel\u00f3gio";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "Um limite que, se violado, far\u00e1 com que o destino remoto suspeito seja registrado em um arquivo especificado";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "Isto acontece normalmente devido a uma competi\u00e7\u00e3o pelo uso da porta 7654. Veja os relat\u00f3rios para verificar";
    t[2940] = "Disabling inbound TCP";
    t[2941] = "Desativando TCP de entrada";
    t[2944] = "Keyring";
    t[2945] = "Gestor de Chaves";
    t[2946] = "Verified family (signing certificate is installed and valid)";
    t[2947] = "Fam\u00edlia verificada (o certificado de assinatura est\u00e1 instalado e \u00e9 v\u00e1lido)";
    t[2954] = "Router info not available";
    t[2955] = "Informa\u00e7\u00f5es do roteador n\u00e3o dispon\u00edveis";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "As aplica\u00e7\u00f5es web Java listadas abaixo s\u00e3o iniciadas pelo cliente webConsole e s\u00e3o executadas no mesmo JVM do roteador. Elas s\u00e3o normalmente aplica\u00e7\u00f5es web acess\u00edveis atrav\u00e9s do console do roteador. Elas podem ser aplica\u00e7\u00f5es completas (por exemplo, i2psnark), interfaces para outros clientes ou aplica\u00e7\u00f5es que devem ser ativadas separadamente (por exemplo, susidns, i2ptunnel) ou n\u00e3o ter nenhuma interface web (por exemplo, addressbook).";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "AVISO - T\u00faneis de entrada de 0 salto n\u00e3o recomendados para roteadores ocultos.";
    t[2972] = "HTTP Proxy";
    t[2973] = "HTTP Proxy";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Este \u00e9 o n\u00famero total de peers conhecidos pelo seu roteador. Eles s\u00e3o listados na <a href='/netdb'>p\u00e1gina do Banco de Dados da Rede</a>. Isso pode variar de menos de 100 a 1000 ou mais. Este n\u00famero n\u00e3o \u00e9 o tamanho total da rede; pode variar amplamente dependendo da sua largura de banda total, largura de banda compartilhada e tr\u00e1fego gerado localmente. O I2P n\u00e3o exige que um roteador conhe\u00e7a todos os outros roteadores na rede.";
