    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "Voc\u00ea pode substituir a <a href=http://127.0.0.1:7658/help/images/>apar\u00eancia padr\u00e3o</a> da listagem de diret\u00f3rios fornecendo um arquivo <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> editado para definir uma apar\u00eancia global. Observe que este arquivo n\u00e3o ser\u00e1 exibido na listagem de diret\u00f3rios do servidor da web. Arquivos e diret\u00f3rios prefixados com . e arquivos com o nome favicon.ico ou arquivos que terminam com ~ ou .bak ou .old tamb\u00e9m ficar\u00e3o ocultos da visualiza\u00e7\u00e3o (embora ainda acess\u00edveis). Nota: Para criar arquivos ocultos com um prefixo . no Windows, adicione um . no final do arquivo ou diret\u00f3rio, por exemplo, <code>.oculto.</code>; O Windows Explorer salvar\u00e1 o arquivo com o nome correto, removendo o ponto final no processo.";
