    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "Quando definido como verdadeiro, funcionalidades adicionais ser\u00e3o habilitadas no console e o usu\u00e1rio poder\u00e1 editar configura\u00e7\u00f5es diretamente na <a href=/configadvanced>p\u00e1gina de Configura\u00e7\u00e3o Avan\u00e7ada</a>. Op\u00e7\u00f5es extras de exibi\u00e7\u00e3o s\u00e3o fornecidas na <a href=/netdb>se\u00e7\u00e3o do Banco de Dados de Rede</a>, incluindo a <a href='/netdb?f=3'>ferramenta de An\u00e1lise de Sybil</a>, e existem op\u00e7\u00f5es adicionais de configura\u00e7\u00e3o na <a href=/configclients>p\u00e1gina de Configura\u00e7\u00e3o de Clientes</a>. Isso tamb\u00e9m permitir\u00e1 a instala\u00e7\u00e3o de atualiza\u00e7\u00f5es n\u00e3o assinadas, configura\u00e7\u00e3o manual da URL de not\u00edcias e se\u00e7\u00f5es adicionais na barra lateral.";
