    t[3302] = "This is an experimental network database tool for debugging and analysis. Do not panic even if you see warnings indicated. Possible \"threats\" are summarized, however these are unlikely to be real threats. If you see anything you would like to discuss with the devs, contact us on IRC #i2p-dev.";
    t[3303] = "Esta \u00e9 uma ferramenta experimental de banco de dados de rede para depura\u00e7\u00e3o e an\u00e1lise. N\u00e3o entre em p\u00e2nico, mesmo que voc\u00ea veja avisos indicados. Poss\u00edveis \"Amea\u00e7as\" est\u00e3o resumidas, no entanto, \u00e9 improv\u00e1vel que elas sejam amea\u00e7as reais. Se voc\u00ea vir alguma coisa que gostaria de discutir com os desenvolvedores, entre em contato conosco no IRC #i2p-dev.";
