    t[3322] = "A <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>Base32</a> link (which always ends with .b32.i2p) is a hash of a <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>Base64</a> destination. For services on the network, the Base64 hash is often mapped to an .i2p domain in the addressbook.";
    t[3323] = "Um link <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>Base32</a> (que sempre termina em .b32.i2p) \u00e9 um hash de um destino <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>Base64</a>. Para servi\u00e7os na rede, o hash Base64 \u00e9 frequentemente mapeado para um dom\u00ednio .i2p no cat\u00e1logo de endere\u00e7os.";
