    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Este \u00e9 o n\u00famero de peers dispon\u00edveis para o seu roteador construir t\u00faneis de cliente. Geralmente est\u00e1 na faixa de 8 a 30. Seus peers r\u00e1pidos s\u00e3o mostrados na p\u00e1gina de <a href='/profiles'>Perfis</a>. <a href='/configstats#router.fastPeers'>[Ativar gr\u00e1ficos]</a>.";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Clique no bot\u00e3o <i>Reabastecer do Arquivo</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Uma variante do roteamento de cebola que criptografa v\u00e1rias mensagens juntas para dificultar a an\u00e1lise de tr\u00e1fego pelos atacantes e aumentar a velocidade da transfer\u00eancia de dados. Para obter mais informa\u00e7\u00f5es, consulte a <a href=https://geti2p.net/en/docs/how/garlic-routing class = 'sitelink external' target = _blank rel = noreferrer>documenta\u00e7\u00e3o online</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Como fortalecer seu site WordPress";
    t[3496] = "I2P Internals";
    t[3497] = "Detalhes I2P";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Por padr\u00e3o, o I2P \u00e9 fornecido com um servidor web para hospedar seu pr\u00f3prio site anonimizado (tradicionalmente chamado de <i>eepsite</i>). Tanto o site quanto o Console do Roteador I2P est\u00e3o rodando em uma vers\u00e3o otimizada do <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, personalizada para a I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Esta configura\u00e7\u00e3o permite que voc\u00ea exclua roteadores mais antigos do seu NetDb. Roteadores mais antigos que o padr\u00e3o ou o valor que voc\u00ea define ser\u00e3o exclu\u00eddos do NetDb e banidos durante a sess\u00e3o do roteador. Por padr\u00e3o, roteadores mais antigos que 0.9.20 s\u00e3o exclu\u00eddos. Observa\u00e7\u00e3o: a partir da vers\u00e3o 0.9.46+ do I2P+, apenas roteadores executando vers\u00f5es muito recentes s\u00e3o usados \u200b\u200bpara construir t\u00faneis locais. [Reinicializa\u00e7\u00e3o necess\u00e1ria]";
