    t[3546] = "This setting, in milliseconds, overrides the default message processing time limit (indicated as <i>Message Delay</i> in the Congestion sidebar section) before the router is determined to be congested and transit tunnel requests are rejected. [Default is 750ms or 1500ms if the router is flagged as slow]";
    t[3547] = "Essa configura\u00e7\u00e3o, em milissegundos, substitui o limite de tempo de processamento de mensagens padr\u00e3o (indicado como <i>Atraso da mensagem</i> na se\u00e7\u00e3o da barra lateral de Congestionamento) antes que o roteador seja considerado congestionado e as solicita\u00e7\u00f5es de t\u00fanel de tr\u00e2nsito sejam rejeitadas. [Padr\u00e3o \u00e9 750ms ou 1500ms se o roteador estiver marcado como lento]";
