    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "Essa configura\u00e7\u00e3o determina se o roteador deve ou n\u00e3o usar o arquivo <i>blocklist.txt</i> fornecido e quaisquer blocklists configuradas pelo usu\u00e1rio para permitir a proibi\u00e7\u00e3o de roteadores por hash ou endere\u00e7o IP. Ranges e m\u00e1scaras de rede s\u00e3o suportados para IPv4, mas n\u00e3o para IPv6. Consulte o arquivo <i>blocklist.txt</i> no diret\u00f3rio de aplicativo do I2P+ para mais informa\u00e7\u00f5es. [Ativado por padr\u00e3o, rein\u00edcio necess\u00e1rio]";
    t[3626] = "Licensing and copyright notices";
    t[3627] = "Licen\u00e7as e avisos de direitos autorais";
