    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "UDP de sa\u00edda na porta 123, permitindo respostas: isso \u00e9 necess\u00e1rio para a sincroniza\u00e7\u00e3o interna de tempo do I2P (via SNTP - consultando um host SNTP aleat\u00f3rio em <code>pool.ntp.org</code> ou <a href=/help/advancedsettings#ntpserverconfig>outro servidor que voc\u00ea especificar</a>).";
    t[3646] = "NetDb Search";
    t[3647] = "Pesquisa NetDb";
    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "Usu\u00e1rios do cliente semelhante ao XChat podem criar uma nova rede com o servidor <code>127.0.0.1/6668</code> (lembre-se de marcar <i>Ignorar servidor proxy</i> se voc\u00ea tiver um servidor proxy configurado), ou voc\u00ea pode conectar com o comando <code>/server 127.0.0.1 6668</code>. Os diferentes clientes de IRC podem variar a sintaxe.";
