    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "As op\u00e7\u00f5es de configura\u00e7\u00e3o do roteador listadas abaixo n\u00e3o est\u00e3o dispon\u00edveis na interface do usu\u00e1rio, geralmente porque s\u00e3o raramente usadas ou fornecem acesso a configura\u00e7\u00f5es avan\u00e7adas que a maioria dos usu\u00e1rios n\u00e3o precisa. Esta n\u00e3o \u00e9 uma lista abrangente. Algumas configura\u00e7\u00f5es exigir\u00e3o uma reinicializa\u00e7\u00e3o do roteador para entrar em vigor. Observe que todas as configura\u00e7\u00f5es diferenciam mai\u00fasculas de min\u00fasculas. Voc\u00ea precisar\u00e1 editar o arquivo <code>router.config</code> para adicionar op\u00e7\u00f5es ou, uma vez adicionada <code>routerconsole.advanced=true</code> ao arquivo router.config, voc\u00ea poder\u00e1 editar as configura\u00e7\u00f5es dentro do console na <a href=/configadvanced>p\u00e1gina de Configura\u00e7\u00e3o Avan\u00e7ada</a>.";
