    t[3754] = "When set to true, your router will not be classified as slow, regardless of the specifications of your host system. Ordinarily, routers running on hosts with the following characteristics will be classified as slow, and various performance-related router options will be modified accordingly:";
    t[3755] = "Quando definido como verdadeiro, seu roteador n\u00e3o ser\u00e1 classificado como lento, independentemente das especifica\u00e7\u00f5es de seu sistema hospedeiro. Normalmente, roteadores em execu\u00e7\u00e3o em hosts com as seguintes caracter\u00edsticas ser\u00e3o classificados como lentos, e v\u00e1rias op\u00e7\u00f5es de roteador relacionadas ao desempenho ser\u00e3o modificadas de acordo:";
