    t[3780] = "To preserve anonymity, make sure that the webserver is not publicly available outside of the I2P network, which is normally achieved by configuring the webserver to listen on localhost (127.0.0.1) rather than all interfaces (0.0.0.0).";
    t[3781] = "Para preservar o anonimato, garanta que o servidor web n\u00e3o esteja dispon\u00edvel publicamente fora da rede I2P, o que normalmente \u00e9 alcan\u00e7ado configurando o servidor web para escutar apenas em localhost (127.0.0.1) e n\u00e3o em todas as interfaces (0.0.0.0).";
