    t[3830] = "Used by client apps. Can be changed to a different port on the <a href=/configclients>Client Configuration page</a> but this is not recommended. Can be bound to a different interface or all interfaces, or disabled, on the <a href=/configclients>Client Configuration page</a>.";
    t[3831] = "Usado por aplicativos do cliente. Pode ser alterado para uma porta diferente na <a href=/configclients>p\u00e1gina de configura\u00e7\u00e3o do cliente</a>, mas isso n\u00e3o \u00e9 recomendado. Pode ser associado a uma interface diferente ou a todas as interfaces, ou desativado, na <a href=/configclients>p\u00e1gina de configura\u00e7\u00e3o do cliente</a>.";
