    t[3838] = "For a more extensive guide to configuration for various browsers, see the <a href=https://geti2p.net/en/about/browser-config target=_blank rel=noreferrer class='sitelink external'>browser configuration guide</a>.";
    t[3839] = "Para um guia mais extenso sobre a configura\u00e7\u00e3o para v\u00e1rios navegadores, consulte o <a href=https://geti2p.net/en/about/browser-config target=_blank rel=noreferrer class='sitelink external'>guia de configura\u00e7\u00e3o do navegador</a>.";
