    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Alguns clientes de IRC s\u00e3o configurados para desconectar do servidor se n\u00e3o houver comunica\u00e7\u00e3o com o servidor por um per\u00edodo de tempo, o que \u00e0s vezes pode ser problem\u00e1tico para o IRC do I2P se o valor de <i>tempo limite de ping</i> estiver muito baixo. Definir o valor de tempo limite de ping em seu cliente para um valor alto (por exemplo, 320 segundos) geralmente resultar\u00e1 em uma conex\u00e3o mais robusta com a rede. No hexchat, voc\u00ea pode configurar o valor digitando <code>/set net_ping_timeout 320</code>. Isso gravar\u00e1 o valor em seu arquivo <code>hexchat.conf</code>.";
    t[3964] = "Run at Startup?";
    t[3965] = "Correr no arranque?";
    t[3972] = "Never";
    t[3973] = "Nunca";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Uma <a href=/confignet#ipchange>configura\u00e7\u00e3o opcional</a> que muda automaticamente sua <a href=/netdb?r=.>identidade do roteador</a> e <a href=/confignet#udpconfig>porta externa</a> quando o endere\u00e7o IP p\u00fablico do seu sistema muda. Isso pode impedir que um advers\u00e1rio correlacione a identidade do seu roteador e o endere\u00e7o IP em cen\u00e1rios onde seu endere\u00e7o IP pode mudar com frequ\u00eancia, por exemplo, quando voc\u00ea est\u00e1 executando o I2P em um laptop em v\u00e1rios locais.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "O roteador n\u00e3o est\u00e1 configurado para publicar seu endere\u00e7o, portanto ele n\u00e3o espera por conex\u00f5es externas.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "Um aplicativo de linha de comando fornecido com o I2P+ (Linux/MacOS) que \u00e9 usado para executar uma solicita\u00e7\u00e3o <code>head</code> em um recurso http especificado na rede, retornando v\u00e1rios cabe\u00e7alhos de resposta do servidor remoto. Por padr\u00e3o, eephead usa o proxy HTTP em <code>127.0.0.1:4444</code>.";
    t[4010] = "NTCP [IPv6] &amp; SSU with Introducers";
