    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "Para acessar sites hospedados na rede I2P e opcionalmente usar o outproxy padr\u00e3o para conectar-se a sites no clearnet, voc\u00ea precisa configurar seu navegador para usar o proxy I2P+ <b>HTTP</b>, que por padr\u00e3o \u00e9 executado em <code>127.0.0.1 porta 4444</code>. Para obter mais ajuda, consulte <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>o guia de configura\u00e7\u00e3o</a> ou <a href=/help/configuration#browserconfig>o mini-tutorial do Firefox</a>.";
