    t[4142] = "An address containing an encrypted LeaseSet is informally referred to as a b33 address, an extension of a base32 address with the host's public key and signature type encoded into the address instead of a lookup hash. This address type is required for blinded Leasesets. More information: <a href=https://geti2p.net/spec/b32encrypted class='sitelink external' target=_blank rel=noreferrer>B33 Specification</a>";
    t[4143] = "Um endere\u00e7o contendo um LeaseSet criptografado \u00e9 informalmente referido como um endere\u00e7o b33, uma extens\u00e3o de um endere\u00e7o base32 com a chave p\u00fablica e o tipo de assinatura do host codificados no endere\u00e7o em vez de um hash de pesquisa. Este tipo de endere\u00e7o \u00e9 necess\u00e1rio para Leasesets cegos. Mais informa\u00e7\u00f5es: <a href=https://geti2p.net/spec/b32encrypted class='sitelink external' target=_blank rel=noreferrer>Especifica\u00e7\u00e3o B33</a>";
