    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Nota: A ordem das declara\u00e7\u00f5es importa. A primeira declara\u00e7\u00e3o de limite para um destino espec\u00edfico (seja expl\u00edcito ou listado em um arquivo referenciado) substitui quaisquer limites futuros para o mesmo destino, seja expl\u00edcito ou listado em um arquivo. Nota: para aplicar um novo arquivo de filtro, o t\u00fanel deve ser reiniciado depois que a localiza\u00e7\u00e3o tiver sido especificada no gerenciador do t\u00fanel. Uma vez configurado, um arquivo de defini\u00e7\u00e3o pode ser atualizado sem exigir a reinicializa\u00e7\u00e3o do t\u00fanel alvo, embora os destinos bloqueados persistam at\u00e9 que o t\u00fanel seja reiniciado.";
