    t[4624] = "<b>Note:</b> On some Apache installations, the <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> and <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modules are enabled by default. It is important to disable these, or otherwise protect access to the urls, to avoid compromising the anonymity and security of your server.";
    t[4625] = "<b>Observa\u00e7\u00e3o:</b> Em algumas instala\u00e7\u00f5es do Apache, os m\u00f3dulos <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> e <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> s\u00e3o habilitados por padr\u00e3o. \u00c9 importante desabilitar esses m\u00f3dulos ou proteger o acesso \u00e0s URLs para evitar comprometer a anonimidade e seguran\u00e7a do seu servidor.";
