    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (TCP baseado em NIO) e NTCP2 s\u00e3o transportes de rede baseados em TCP que utilizam a implementa\u00e7\u00e3o Java NIO (Nova E/S) TCP para transmitir mensagens I2NP entre roteadores na rede. NTCP2 melhora a resist\u00eancia do NTCP a v\u00e1rios ataques e m\u00e9todos de identifica\u00e7\u00e3o de tr\u00e1fego automatizados. Para mais informa\u00e7\u00f5es, consulte a <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>documenta\u00e7\u00e3o online</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "Voc\u00ea pode usar um gravador para registrar os destinos de clientes agressivos em um arquivo especificado e, em seguida, usar o mesmo arquivo para limit\u00e1-los. O trecho a seguir define um filtro que, inicialmente, permite todas as solicita\u00e7\u00f5es de conex\u00e3o, mas, se algum destino \u00fanico exceder 180 solicita\u00e7\u00f5es em 60 segundos, ele ser\u00e1 limitado a 30 solicita\u00e7\u00f5es a cada 60 segundos:";
