    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "Essa configura\u00e7\u00e3o, quando configurada com um caminho apontando para um arquivo de blocklist v\u00e1lido, permite que uma blocklist adicional configurada pelo usu\u00e1rio seja carregada na inicializa\u00e7\u00e3o do roteador. [Desativado por padr\u00e3o, rein\u00edcio necess\u00e1rio]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ suporta substitui\u00e7\u00f5es de tema personalizadas para o console, o gerenciador de t\u00fanel, I2PSnark, SusiDNS e Susimail, permitindo altera\u00e7\u00f5es nos temas que s\u00e3o persistentes ap\u00f3s as atualiza\u00e7\u00f5es. Para ativar uma substitui\u00e7\u00e3o, crie um arquivo css chamado <code>override.css</code> com as modifica\u00e7\u00f5es do tema e coloque-o no diret\u00f3rio do tema relevante do tema que voc\u00ea deseja alterar, ou renomeie um dos arquivos de exemplo e, em seguida, atualize o navegador. Observe que o gerenciador de t\u00fanel e o console compartilham o mesmo override.css. Para desativar uma substitui\u00e7\u00e3o, exclua ou renomeie o arquivo <code>override.css</code> e, em seguida, atualize o navegador (geralmente Control + Shift + R).";
