    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "Quando definido como verdadeiro, essa configura\u00e7\u00e3o permite pesquisas reversas de DNS para peers, acionadas ao exibir a bandeira do pa\u00eds de um peer ou quando o nome do host ou dom\u00ednio s\u00e3o explicitamente exibidos no console, ou quando as informa\u00e7\u00f5es do roteador do peer s\u00e3o gravadas no disco. Para evitar pesquisas repetidas, \u00e9 recomendado configurar uma pol\u00edtica de armazenamento em cache generosa para pesquisas de DNS de 10 minutos ou mais, e configurar um servidor DNS que respeite a privacidade em seu sistema operacional. [Desativado por padr\u00e3o, rein\u00edcio necess\u00e1rio]";
