    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "Se voc\u00ea estiver executando um site din\u00e2mico que lida com um grande n\u00famero de usu\u00e1rios simult\u00e2neos, o cache de conte\u00fado geralmente pode melhorar o tempo necess\u00e1rio para fornecer p\u00e1ginas. Para conte\u00fado que muda rapidamente, uma estrat\u00e9gia de <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-cache</a> ainda pode trazer alguns benef\u00edcios. O servidor da web <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx</a> fornece um subsistema de cache competente, ou, para uma solu\u00e7\u00e3o mais robusta, d\u00ea uma olhada em <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
