    t[5331] = "A assinatura padr\u00e3o \u00e9 para <code>http://i2p-projekt.i2p/hosts.txt</code> que raramente \u00e9 atualizada. Se voc\u00ea n\u00e3o tiver outra assinatura, muitas vezes voc\u00ea ter\u00e1 que usar links \"jump\", que \u00e9 muito mais lento, mas garante que seu livro de endere\u00e7os seja populado apenas por sites que voc\u00ea usa (al\u00e9m dos endere\u00e7os da assinatura padr\u00e3o). Para acelerar a navega\u00e7\u00e3o no I2P, \u00e9 uma boa ideia adicionar algumas assinaturas de livros de endere\u00e7os.";
