    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Se ap\u00f3s alguns minutos de funcionamento, o seu roteador indicar 0 Pares Ativos e 0 Pares Conhecidos, com uma notifica\u00e7\u00e3o na barra lateral informando que voc\u00ea precisa verificar sua conex\u00e3o de rede, verifique se voc\u00ea consegue acessar a internet. Se a sua conex\u00e3o com a internet estiver funcionando, talvez seja necess\u00e1rio desbloquear o Java no seu firewall. Caso contr\u00e1rio, talvez seja necess\u00e1rio reiniciar o seu roteador I2P. Acesse a p\u00e1gina de <a href=/configreseed#reseedconfig>Configura\u00e7\u00e3o de Reinicializa\u00e7\u00e3o</a> e clique no bot\u00e3o <i>Salvar Altera\u00e7\u00f5es e Reinicializar Agora</i>. Para mais informa\u00e7\u00f5es, consulte a se\u00e7\u00e3o de ajuda sobre reinicializa\u00e7\u00e3o <a href=#reseedhelp>aqui</a>.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Uma API de soquete de n\u00edvel superior para clientes. S\u00f3 \u00e9 aberta quando um cliente SAM V3 solicita uma sess\u00e3o UDP. Pode ser ativado/desativado na <a href=/configclients>p\u00e1gina de configura\u00e7\u00e3o do cliente</a>. Pode ser alterado no arquivo <code>clients.config</code> com a op\u00e7\u00e3o de linha de comando do SAM <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Se voc\u00ea deseja que seu site seja responsivo, a compress\u00e3o de imagens \u00e9 essencial ao hospedar imagens grandes. Usar um servi\u00e7o como <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> para comprimir suas imagens png e jpeg geralmente resultar\u00e1 em arquivos muito menores com perda m\u00ednima de qualidade. Em algumas situa\u00e7\u00f5es, o formato webp pode ser superior aos jpegs, gerando arquivos menores com aproximadamente a mesma ou melhor fidelidade visual e tendo amplo suporte de navegadores. Considere tamb\u00e9m o uso de svgs em vez de bitmaps para \u00edcones e ilustra\u00e7\u00f5es - eles costumam ser menores do que o arquivo de bitmap equivalente (execute-os em um servi\u00e7o como <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> para remover arquivos desnecess\u00e1rios), escalando sem perda de qualidade e podendo ser compactados por seu servidor da web.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP est\u00e1 desabilitado nesse dispositivo";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Por padr\u00e3o, a maioria dos servi\u00e7os do cliente (correio, proxy HTTP, IRC) compartilhar\u00e1 o mesmo conjunto de t\u00faneis (por raz\u00f5es de desempenho) e ser\u00e3o listados como <i>Clientes Compartilhados</i> e <i>Clientes Compartilhados(DSA) </ i> na barra lateral em T\u00faneis de Servi\u00e7o e na p\u00e1gina <a href=/tunnels>T\u00faneis</a>.";
