    t[5545] = "Esta se\u00e7\u00e3o n\u00e3o est\u00e1 habilitada por padr\u00e3o a menos que o modo <a href='/help/configuration#advancedconsole'>Advanced Console</a> esteja habilitado. Voc\u00ea pode ativ\u00e1-lo na p\u00e1gina de <a href='/configsidebar'>Configura\u00e7\u00f5es da Barra Lateral</a>.";
