    t[5613] = "Um caminho de comunica\u00e7\u00e3o criptografado <a href=https://geti2p.net/en/docs/tunnels/unidirectional class='sitelink external' target=_blank rel=noreferrer>unidirecional</a> entre um cliente ou servidor na rede I2P. Similar a um circuito no Tor, exceto que os circuitos Tor s\u00e3o bidirecionais.";
