    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Firewalled com TCP de entrada ativado";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Abra a <a href=/confignet#udpconfig>porta do I2P+</a> no seu modem, roteador e/ou firewall(s) para uma melhor conectividade (idealmente tanto UDP quanto TCP). Mais informa\u00e7\u00f5es sobre como fazer o redirecionamento de portas podem ser encontradas no <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, al\u00e9m dos nossos f\u00f3runs e canais IRC listados abaixo. Note que o I2P n\u00e3o suporta a conex\u00e3o com a internet atrav\u00e9s de um proxy http ou socks [patches bem-vindos!], embora voc\u00ea possa se conectar a proxies via I2P uma vez conectado \u00e0 rede.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Um filtro de t\u00fanel pode fornecer prote\u00e7\u00e3o contra ataques de nega\u00e7\u00e3o de servi\u00e7o, sem interromper o servi\u00e7o para usu\u00e1rios genu\u00ednos, seja em conjunto com um limitador de velocidade de t\u00fanel ou como uma estrat\u00e9gia alternativa. Tamb\u00e9m pode ser usado para registrar o acesso a um servi\u00e7o hospedado para determinar se o servidor est\u00e1 sendo atacado, ou simplesmente para registrar todos os visitantes por destino I2P. Al\u00e9m disso, um filtro pode funcionar simultaneamente como uma lista branca e uma lista negra, tornando-o mais flex\u00edvel do que os controles de lista de acesso do Gerenciador de T\u00faneis. Observe que v\u00e1rios t\u00faneis de servidor podem compartilhar um \u00fanico arquivo de filtro se voc\u00ea deseja implementar um filtro global.";
