    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Esta configura\u00e7\u00e3o (em milissegundos) permite que voc\u00ea configure manualmente o atraso entre as atualiza\u00e7\u00f5es de atualiza\u00e7\u00e3o do roteador executadas pelo Job de atualiza\u00e7\u00e3o de roteadores. Por padr\u00e3o, a pausa entre as atualiza\u00e7\u00f5es \u00e9 determinada pelo tamanho do NetDb e introduz alguma aleatoriedade no momento para mitigar a an\u00e1lise de tr\u00e1fego. Para valores inferiores a 2000 milissegundos, \u00e9 recomend\u00e1vel aumentar o valor de <code>router.refreshTimeout</code>. Observe que definir esse valor abaixo de 2000 milissegundos aumentar\u00e1 seu tr\u00e1fego na rede e poder\u00e1 introduzir atrasos no trabalho, n\u00e3o sendo recomendado para uso cont\u00ednuo.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "T\u00faneis do servidor, configur\u00e1veis no <a href=/i2ptunnelmgr>Gerenciador de T\u00faneis</a>, fornecem v\u00e1rias maneiras de limitar o acesso ao servi\u00e7o hospedado. Listagem em lista branca, lista negra, redu\u00e7\u00e3o da velocidade de conex\u00e3o e filtragem de t\u00fanel s\u00e3o m\u00e9todos fornecidos para mitigar ataques de nega\u00e7\u00e3o de servi\u00e7o, conceder acesso exclusivo a destinos I2P conhecidos e gerenciar o tr\u00e1fego para o servidor.";
