    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "N\u00e3o revele esse arquivo para usu\u00e1rios desconhecidos, pois ele cont\u00e9m dados sens\u00edveis (100 arquivos RouterInfo) do seu pr\u00f3prio roteador I2P, que potencialmente poderiam ser usados por um advers\u00e1rio para desmascarar sua identidade. Para proteger sua anonimidade, voc\u00ea deve esperar algumas horas/dias antes de compartilhar o arquivo com seu amigo de confian\u00e7a. Tamb\u00e9m \u00e9 aconselh\u00e1vel usar esse procedimento com parcim\u00f4nia (n\u00e3o mais do que uma vez por semana).";
