    t[6244] = "The act of contributing to the network by permitting other routers to build tunnels using your router in a tunnel chain. At least 12KB/s upstream bandwidth (network share) is required to be allocated in order to enable participation. Note that firewalled routers will be limited in how much they contribute to participation, and a router designated as Hidden will not participate at all.";
    t[6245] = "O ato de contribuir para a rede, permitindo que outros roteadores construam t\u00faneis usando seu roteador em uma cadeia de t\u00faneis. \u00c9 necess\u00e1rio alocar pelo menos 12KB/s de largura de banda de upload (partilha de rede) para habilitar a participa\u00e7\u00e3o. Observa\u00e7\u00e3o: roteadores com firewall ter\u00e3o sua contribui\u00e7\u00e3o para a participa\u00e7\u00e3o limitada, e um roteador designado como Oculto n\u00e3o participar\u00e1 de forma alguma.";
