    t[6350] = "This setting determines the number of peers to explore in parallel when the Peer Exploration Job runs [default is 1 peer at a time when more than 3000 peers are known]. Note that increasing this value will increase the bandwidth requirements for the exploration, and setting this value too high may cause excessive message delay and interfere with other services, so use with caution!";
    t[6351] = "Esta configura\u00e7\u00e3o determina o n\u00famero de pares a serem explorados em paralelo quando o Job de Explora\u00e7\u00e3o de Pares \u00e9 executado [o padr\u00e3o \u00e9 1 par por vez quando mais de 3000 pares s\u00e3o conhecidos]. Observe que aumentar esse valor aumentar\u00e1 os requisitos de largura de banda para a explora\u00e7\u00e3o e definir esse valor muito alto pode causar atraso excessivo nas mensagens e interferir em outros servi\u00e7os, portanto, use com cautela!";
