    t[6376] = "If the skew is more than a few seconds, please correct the problem by adjusting your computer's time.";
    t[6377] = "Se o desvio for superior a alguns segundos, corrija o problema ajustando o hor\u00e1rio do seu computador.";
    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Nota: Para aumentar sua seguran\u00e7a ao navegar em sites .i2p, voc\u00ea pode considerar a instala\u00e7\u00e3o de um complemento que impede a execu\u00e7\u00e3o de JavaScript no navegador, como o <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, embora seja recomendado whitelista o endere\u00e7o em que o I2P+ est\u00e1 sendo executado para habilitar v\u00e1rias melhorias no console do roteador. Al\u00e9m disso, \u00e9 recomendado tamb\u00e9m a instala\u00e7\u00e3o de um complemento que impede solicita\u00e7\u00f5es a recursos externos, por exemplo <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
