    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ pode ser lento para se integrar na rede na primeira vez que voc\u00ea o executa, pois ele se inicializa na rede e aprende sobre pares adicionais. Quanto mais tempo o seu roteador I2P+ estiver em execu\u00e7\u00e3o, melhor ele funcionar\u00e1. Portanto, tente mant\u00ea-lo ligado o m\u00e1ximo poss\u00edvel, 24 horas por dia, 7 dias por semana, se poss\u00edvel! Se, ap\u00f3s 30 minutos, a contagem de <i> Ativo: [conectado/recente] </i> ainda tiver menos de 10 pares, ou o n\u00famero total de pares <i> Integrados </i> for inferior a 5, existem v\u00e1rias coisas que voc\u00ea pode fazer para verificar problemas:";
