    t[6943] = "Alta capacidade";
    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Uma implementa\u00e7\u00e3o em java de um cliente Tor, dispon\u00edvel como um plugin I2P. Pode ser usado como <i>outproxy</i> padr\u00e3o, se configurado no t\u00fanel SOCKS ou cliente HTTP relevante no <i>Gerenciador de T\u00faneis</i>. Dispon\u00edvel em <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. O c\u00f3digo-fonte est\u00e1 dispon\u00edvel no <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "Endere\u00e7os de IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Esta se\u00e7\u00e3o indica as velocidades m\u00e9dias de largura de banda e o uso total para a sess\u00e3o. Todos os valores est\u00e3o em bytes por segundo. Voc\u00ea pode alterar os limites de largura de banda na <a href='/config'>p\u00e1gina de configura\u00e7\u00e3o de largura de banda</a>. Quanto mais largura de banda voc\u00ea disponibilizar, mais ajuda a rede e melhora sua pr\u00f3pria anonimidade, ent\u00e3o reserve um tempo para revisar as configura\u00e7\u00f5es. Se voc\u00ea n\u00e3o tem certeza da velocidade da sua rede, usar um servi\u00e7o como <a href='http://speedtest.net/'>SpeedTest</a> ou similar lhe dar\u00e1 uma boa indica\u00e7\u00e3o da capacidade da sua largura de banda. A quantidade compartilhada de upstream (KBps Out) determinar\u00e1 sua contribui\u00e7\u00e3o geral para a rede. Por padr\u00e3o, a largura de banda \u00e9 <a href='/graphs'>exibida em gr\u00e1ficos</a>.";
