    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Essa configura\u00e7\u00e3o permite que voc\u00ea configure o n\u00famero m\u00ednimo de t\u00faneis participantes hospedados antes de o roteador come\u00e7ar a rejeitar solicita\u00e7\u00f5es de tunelamento com base nos requisitos de largura de banda previstos. [O padr\u00e3o \u00e9 100 se o sistema estiver executando o Android, 800 se o sistema estiver em execu\u00e7\u00e3o em ARM e menos de 4 n\u00facleos dispon\u00edveis, 1200 se o sistema estiver em execu\u00e7\u00e3o em ARM e 4 ou mais n\u00facleos dispon\u00edveis, caso contr\u00e1rio 2500]";
    t[7012] = "Delete key";
