    t[7015] = "Forne\u00e7a uma senha";
    t[7022] = "This setting (in milliseconds) allows you to manually configure the queue delay target value for the CoDel queue management system. Default is 50ms. [Restart required]";
    t[7023] = "Esta configura\u00e7\u00e3o (em milissegundos) permite configurar manualmente o valor alvo de atraso da fila para o sistema de gerenciamento de filas CoDel. O padr\u00e3o \u00e9 50 ms. [Rein\u00edcio necess\u00e1rio]";
    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "Para manter o anonimato, \u00e9 recomend\u00e1vel atualizar usando o proxy I2P HTTP. Se as not\u00edcias ou a atualiza\u00e7\u00e3o i2p estiverem hospedadas no i2p, o uso do proxy ser\u00e1 necess\u00e1rio.";
