    t[7055] = "Um limite a ser aplicado a destinos remotos listados em um arquivo";
    t[7062] = "The su3 format is preferred, as it will be verified as signed by a trusted source.";
    t[7063] = "O formato su3 \u00e9 o preferido, pois ser\u00e1 verificado como assinado por uma fonte confi\u00e1vel.";
