    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P n\u00e3o funciona adequadamente atr\u00e1s desse tipo de parede de fogo. Provavelmente n\u00e3o poder\u00e1s receber conex\u00f5es vindas de fora, o que limitar\u00e1s tua participa\u00e7\u00e3o na rede.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "O Protocolo do Cliente I2P (I2CP) permite que aplicativos externos (clientes) se comuniquem com o I2P por meio de um \u00fanico soquete TCP, usando por padr\u00e3o a porta 7654. Para obter mais informa\u00e7\u00f5es, consulte a <a href=https://geti2p.net/en/docs/protocol/i2cp class = 'sitelink external' target =_blank rel = noreferrer>documenta\u00e7\u00e3o online</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "Totais da fila";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Esta configura\u00e7\u00e3o determina qual transporte tem prioridade ao se comunicar com outros peers. Por padr\u00e3o, NTCP \u00e9 preferido em rela\u00e7\u00e3o ao UDP (SSU). Ao definir o valor como true, UDP ser\u00e1 preferido a menos que uma conex\u00e3o NTCP pr\u00e9-existente exista; quando definido como always, UDP ser\u00e1 sempre usado independente de qualquer conex\u00e3o NTCP pr\u00e9-existente. [Padr\u00e3o \u00e9 false]";
