    t[7282] = "Length";
    t[7283] = "comprimento";
    t[7284] = "The data gathered is quantized over a 1 minute period, so should just be used as an estimate.";
    t[7285] = "Os dados coletados s\u00e3o a quantidade de cada minuto, ent\u00e3o devem ser usados apenas como estimativa";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Quando configurado para true, o I2P \u00e9 executado sem conectividade de rede, o que \u00e9 \u00fatil se voc\u00ea estiver reiniciando constantemente o roteador para testar atualiza\u00e7\u00f5es de c\u00f3digo, pois isso evita a interrup\u00e7\u00e3o da rede.";
    t[7302] = "Updating IP address";
    t[7303] = "Atualizando endere\u00e7o de IP";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "Apenas IPv6 com introdutores SSU";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) \u00e9 um transporte de rede I2P que fornece conex\u00f5es criptografadas, orientadas \u00e0 conex\u00e3o e ponto a ponto, al\u00e9m de servi\u00e7os de detec\u00e7\u00e3o de endere\u00e7o IP e travessia NAT. Para mais informa\u00e7\u00f5es, consulte a <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>documenta\u00e7\u00e3o online</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Janela de congestionamento";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Use proxy para propagar novamente";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "At\u00e9 o surgimento da integra\u00e7\u00e3o da I2P no <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, n\u00e3o era poss\u00edvel baixar torrents que n\u00e3o estivessem hospedados na rede I2P. No entanto, agora que o Vuze (e posteriormente o <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) permitem que os usu\u00e1rios compartilhem torrents n\u00e3o-I2P no I2P, \u00e9 poss\u00edvel baixar torrents n\u00e3o-I2P atrav\u00e9s do I2P se os usu\u00e1rios do Vuze/Bigly tiverem escolhido tornar o conte\u00fado dispon\u00edvel para a rede I2P. Torrents populares com um grande n\u00famero de peers s\u00e3o mais propensos a estar acess\u00edveis atrav\u00e9s do I2P; para verificar se o conte\u00fado est\u00e1 dispon\u00edvel, adicione o link do torrent, magnet ou infohash ao seu cliente de BitTorrent ativado para I2P.";
