    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "Esta configura\u00e7\u00e3o (em horas) determina a idade de um RouterInfo no NetDb (sua \u00faltima data de publica\u00e7\u00e3o conhecida) antes de ser classificado como obsoleto e exclu\u00eddo. [Padr\u00e3o \u00e9 28 horas, a menos que o enrutador seja um Floodfill, caso em que o padr\u00e3o \u00e9 8 horas]";
