    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Se um <i>Registro de Autentica\u00e7\u00e3o</i> for solicitado, voc\u00ea pode encontr\u00e1-lo na p\u00e1gina de <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Autentica\u00e7\u00e3o de Registro</a> vinculada \u00e0 p\u00e1gina de <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Configura\u00e7\u00e3o do Gerenciador de T\u00faneis</a>. A autentica\u00e7\u00e3o de registro garante que apenas o propriet\u00e1rio possa registrar ou gerenciar o nome do host, e \u00e9 necess\u00e1ria para stats.i2p e reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Not\u00edcias &amp; Atualiza\u00e7\u00f5es";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Se voc\u00ea n\u00e3o conseguir iniciar o roteador com <code>i2p/i2prouter start</code>, tente o script <code>runplain.sh</code> no mesmo diret\u00f3rio. Privil\u00e9gios de root nunca s\u00e3o necess\u00e1rios para executar o I2P+. Se voc\u00ea precisa compilar a biblioteca <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi</a> (que \u00e9 necess\u00e1ria em casos raros), consulte a documenta\u00e7\u00e3o, visite os f\u00f3runs ou o <a href=irc://127.0.0.1:6668/saltR class=chatlink>canal I2P+</a> ou <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>canal de desenvolvedores do IRC</a>.";
