    t[7458] = "Information defining the unique identity of a router on the network which includes its IP address (or the IP addresses of intermediate introducers) and listening port, public signing and encryption keys. Router identities correlate to peers in the NetDB. Also referred to as a <i>RouterInfo</i>.";
    t[7459] = "Informa\u00e7\u00f5es que definem a identidade \u00fanica de um roteador na rede, que inclui seu endere\u00e7o IP (ou os endere\u00e7os IP dos intermediadores intermedi\u00e1rios) e porta de escuta, chaves p\u00fablicas de assinatura e criptografia. As identidades dos roteadores est\u00e3o correlacionadas com os pares no NetDB. Tamb\u00e9m \u00e9 conhecido como <i>Informa\u00e7\u00f5es do Roteador</i>.";
