    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Um banco de dados distribu\u00eddo que cont\u00e9m informa\u00e7\u00f5es de contato do roteador (RouterInfos) e informa\u00e7\u00f5es de contato do destino (LeaseSets). Um \u00fanico roteador mant\u00e9m seu pr\u00f3prio banco de dados (parcial) para comunica\u00e7\u00e3o com outros roteadores na rede; nenhum roteador \u00fanico manter\u00e1 uma lista de todos os roteadores. Os RouterInfos s\u00e3o armazenados em disco e lidos na mem\u00f3ria quando o roteador \u00e9 iniciado, ou quando novos RouterInfos s\u00e3o adquiridos. Tamb\u00e9m mencionado como o <i>NetDb</i>. Para mais informa\u00e7\u00f5es, consulte a <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>documenta\u00e7\u00e3o online</a>.";
    t[7692] = "Address";
    t[7693] = "Endere\u00e7o";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Um limite \u00e9 definido pelo n\u00famero de tentativas de conex\u00e3o que um destino remoto pode realizar em um n\u00famero espec\u00edfico de segundos antes de ocorrer uma \"viola\u00e7\u00e3o\".";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Clearnet normalmente se refere \u00e0 internet de acesso p\u00fablico, o oposto do darknet, que normalmente descreve os servi\u00e7os criptografados e an\u00f4nimos constru\u00eddos em I2P, Tor, etc. Para mais informa\u00e7\u00f5es, consulte o <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>artigo da Wikipedia</a>.";
