    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "Define o n\u00famero m\u00e1ximo de <a href=/jobs>tarefas</a> paralelas que podem ser executadas. O valor padr\u00e3o \u00e9 determinado pela quantidade de mem\u00f3ria alocada para a JVM via <code>wrapper.config</code> e \u00e9 definido como 3 para menos de 64MB, 4 para menos de 256M ou 5 para mais de 256MB. Observa\u00e7\u00e3o: uma altera\u00e7\u00e3o dessa configura\u00e7\u00e3o requer uma reinicializa\u00e7\u00e3o do roteador.";
