    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "Um roteador na rede encarregado de fornecer e receber informa\u00e7\u00f5es sobre outros roteadores e servi\u00e7os na rede. A largura de banda m\u00ednima compartilhada atual para um roteador ser considerado capaz de executar tarefas de floodfill \u00e9 de 128 KBytes / s, embora seja poss\u00edvel substituir esse requisito e for\u00e7ar um roteador a ser um floodfill na <a href=/configadvanced>p\u00e1gina de Configura\u00e7\u00e3o Avan\u00e7ada</a>. Para obter mais informa\u00e7\u00f5es, consulte a <a href=https://geti2p.net/en/docs/how/network-database#floodfill class = 'sitelink external' target = _blank rel = noreferrer>documenta\u00e7\u00e3o online</a>.";
