    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Onde for poss\u00edvel, ativos que s\u00e3o usados repetidamente em seu site devem ser carregados de um arquivo externo e n\u00e3o inline. Se voc\u00ea estiver usando o mesmo CSS em v\u00e1rias p\u00e1ginas, crie um arquivo css separado e carregue-o na se\u00e7\u00e3o <code>&lt;head&gt;</code> de suas p\u00e1ginas. Isso facilitar\u00e1 a atualiza\u00e7\u00e3o de estilos em seu site e tamb\u00e9m permitir\u00e1 que o arquivo seja armazenado em cache no navegador do visitante, resultando em menos demandas de largura de banda em seu servidor da web e tempos de carregamento mais r\u00e1pidos para seus visitantes.";
