    t[8332] = "Messages sent to peer";
    t[8333] = "Mensagens enviadas para pares";
    t[8334] = "Function";
    t[8335] = "Fun\u00e7\u00e3o";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Na rede I2P, servi\u00e7os hospedados remotamente podem ser acessados usando um endere\u00e7o <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> terminando em \".b32.i2p\", um <i>destino</i> representado como uma string Base64 longa <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>, ou mais usualmente usando um dom\u00ednio .i2p. Um destino \u00e9 o equivalente do I2P para um endere\u00e7o IP e \u00e9 mostrado na <a href='/i2ptunnel/edit?tunnel=3'>p\u00e1gina de configura\u00e7\u00e3o do Gerenciador de T\u00faneis</a>. Voc\u00ea pode compartilhar o seu endere\u00e7o b32.i2p para permitir que outros acessem o seu website at\u00e9 voc\u00ea registrar o seu pr\u00f3prio dom\u00ednio .i2p.";
