    t[8350] = "Enter the name and paste the destination into your <a href='/dns?book=router&amp;filter=none'>address book</a>. Click <i>Add</i> to save the new entry.";
    t[8351] = "Digite o nome e cole o destino na sua <a href='/dns?book=router&amp;filter=none'>agenda de endere\u00e7os book</a>. Clique em <i>adicionar</i> para salvar a nova entrada.";
    t[8358] = "Stats";
