    t[8364] = "Recorders keep track of connection attempts made by a remote destination, and if that breaches the defined threshold, the destination gets logged in the specified file. Multiple recorders can be specified:";
    t[8365] = "Os gravadores acompanham as tentativas de conex\u00e3o feitas por um destino remoto e, se ultrapassar o limite definido, o destino \u00e9 registrado no arquivo especificado. V\u00e1rios gravadores podem ser especificados:";
