    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Para desativar a listagem de diret\u00f3rios, encontre a entrada para <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> no arquivo <code>base-context.xml</code>, localizado na pasta <code>eepsite/contexts</code> (logo acima da pasta docroot), e altere 'verdadeiro' para 'falso' imediatamente abaixo. Para aplicar a altera\u00e7\u00e3o imediatamente, pare e reinicie o cliente <i>I2P Webserver</i> na p\u00e1gina <a href=/configclients>Configura\u00e7\u00e3o do Cliente</a>. Voc\u00ea tamb\u00e9m pode colocar um arquivo <code>index.html</code> vazio em qualquer diret\u00f3rio exposto para suprimir a listagem de diret\u00f3rios para aquele local.";
