    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "Se n\u00e3o est\u00e1 usando IE, \u00e9 poss\u00edvel que teu navegador esteja fingindo ser o IE; Favor configurar teu navegador (ou proxy) para usar uma identifica\u00e7\u00e3o \"user-agent\" diferente se queres ter acesso aos temas para o pain\u00e9l.";
