    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Logs</a> podem ajudar a resolver um problema. Voc\u00ea pode querer colar trechos em um <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>f\u00f3rum</a> para obter ajuda, ou talvez <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>cole</a> e referencie o link no IRC para obter ajuda.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Os plugins assinados com a chave criptogr\u00e1fica do desenvolvedor s\u00e3o o formato recomendado, mas se voc\u00ea deseja instalar plugins n\u00e3o assinados (.zip), pode definir isso como verdadeiro. Observe que voc\u00ea ainda poder\u00e1 encontrar problemas ao tentar instalar um plugin n\u00e3o assinado se o desenvolvedor tiver inclu\u00eddo verifica\u00e7\u00f5es adicionais no processo de cria\u00e7\u00e3o do plugin.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Se voc\u00ea est\u00e1 executando uma inst\u00e2ncia standalone do Tor localmente, pode us\u00e1-lo configurando o uso do I2P: <i>Tipo de proxy:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Porta:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Selecione o idioma a ser utilizado para o console do roteador e aplicativos da web (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>gerenciador de t\u00faneis</a>, etc). Se voc\u00ea deseja alterar o idioma no futuro, alterar o tema do console do roteador ou configurar uma senha para acessar o console, voc\u00ea pode faz\u00ea-lo na <a href=/configui target=_blank rel=noreferrer>p\u00e1gina de configura\u00e7\u00e3o da interface do usu\u00e1rio</a>.";
