    t[9052] = "Ready";
    t[9053] = "Pronto";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Estes s\u00e3o os servi\u00e7os locais fornecidos pelo seu roteador. Eles podem ser clientes iniciados atrav\u00e9s do <a href='/i2ptunnelmgr'>Gerenciador de T\u00faneis</a> ou programas externos conectando atrav\u00e9s do SAM, BOB ou diretamente no I2CP. Por padr\u00e3o, a maioria dos servi\u00e7os do cliente (e-mail, proxy http, IRC) compartilhar\u00e3o o mesmo conjunto de t\u00faneis e ser\u00e3o listados como <i>Clientes Compartilhados</i> e <i>Clientes Compartilhados(DSA)</i>, o que melhora a anonimato misturando o tr\u00e1fego de todos os servi\u00e7os compartilhados e reduz a sobrecarga necess\u00e1ria para construir e manter t\u00faneis. No entanto, se ocorrer uma falha no t\u00fanel, todos os seus servi\u00e7os ficar\u00e3o offline ao mesmo tempo. Portanto, em alguns cen\u00e1rios, voc\u00ea pode desejar configurar servi\u00e7os de cliente para usar seu pr\u00f3prio conjunto de t\u00faneis. Isso pode ser feito desmarcando a op\u00e7\u00e3o <i>Compartilhar t\u00faneis com outros clientes&hellip;</i> listada em <i>Clientes Compartilhados</i> na p\u00e1gina de configura\u00e7\u00e3o do servi\u00e7o de cliente relevante no Gerenciador de T\u00faneis, ap\u00f3s o que voc\u00ea precisar\u00e1 reiniciar o servi\u00e7o de cliente a partir da <a href='/i2ptunnelmgr'>p\u00e1gina principal do Gerenciador de T\u00faneis</a>.";
