    t[9203] = "Observa\u00e7\u00e3o: A maioria das op\u00e7\u00f5es no Gerenciador de T\u00faneis tem dicas; certifique-se de verificar antes de alterar configura\u00e7\u00f5es que voc\u00ea n\u00e3o entende completamente!";
