    t[9238] = "UPnP SSDP UDP multicast listener";
    t[9239] = "Ouvinte multicast UPnP SSDP UDP";
    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Um aplicativo CGI simples que recebe um nome de host como par\u00e2metro e retorna um redirecionamento 301 para a URL correta com uma string <code>?i2paddresshelper=key</code> anexada. O proxy HTTP ir\u00e1 interpretar a string anexada e usar a chave como destino real. Al\u00e9m disso, o proxy armazenar\u00e1 em cache a chave para que o auxiliar de endere\u00e7o n\u00e3o seja necess\u00e1rio at\u00e9 a reinicializa\u00e7\u00e3o e oferecer\u00e1 a op\u00e7\u00e3o de adicionar o endere\u00e7o resolvido \u00e0 agenda de endere\u00e7os.";
