    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Esta configura\u00e7\u00e3o (em minutos) permite que voc\u00ea configure manualmente o tempo a ser aguardado ap\u00f3s a inicializa\u00e7\u00e3o antes que os RouterInfos no NetDb sejam verificados em termos de validade, ap\u00f3s o qual somente roteadores v\u00e1lidos ser\u00e3o aceitos para inclus\u00e3o. Quando a valida\u00e7\u00e3o ocorre, RouterInfos expirados e pares inativos acess\u00edveis apenas via SSU ser\u00e3o removidos do NetDb. [O padr\u00e3o \u00e9 de 60 minutos] Nota: Esta configura\u00e7\u00e3o n\u00e3o afeta roteadores mais antigos (anteriores a 0.9.29 por padr\u00e3o), que s\u00e3o removidos do NetDb e banidos para a sess\u00e3o do roteador assim que um armazenamento do NetDb \u00e9 tentado.";
    t[9294] = "Linux";
