    t[9316] = "Please include your I2P version and running environment information in bug reports";
    t[9317] = "Inclua sua vers\u00e3o I2P e informa\u00e7\u00f5es do ambiente em execu\u00e7\u00e3o nos relat\u00f3rios de bugs";
