    t[9326] = "The router's external port allows communication with other routers. It is recommended to configure your firewall to allow inbound and outbound traffic on this port to optimize your router's performance on the network.";
    t[9327] = "A porta externa do roteador permite a comunica\u00e7\u00e3o com outros roteadores. Recomenda -se configurar seu firewall para permitir que o tr\u00e1fego de entrada e sa\u00edda nesta porta otimize o desempenho do seu roteador na rede.";
    t[9328] = "Bulk Thresholds";
    t[9329] = "Limiares em massa";
    t[9334] = "If the problem persists, verify that you have cookies enabled in your browser.";
    t[9335] = "Se o problema continuar, verifique se teu navegador aceita cookies.";
    t[9350] = "Good Lookups";
    t[9351] = "Boas pesquisas";
    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Ressemeando \u00e9 o processo de inicializa\u00e7\u00e3o usado para encontrar outros roteadores quando voc\u00ea instala o I2P pela primeira vez ou quando o seu roteador tem poucas refer\u00eancias de roteador restantes. As configura\u00e7\u00f5es padr\u00e3o funcionar\u00e3o para a maioria das pessoas. Mude-as apenas se o HTTPS for bloqueado por um firewall restritivo e a ressemeadura falhar.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Quando ativada, esta configura\u00e7\u00e3o modifica o atraso adicional m\u00e1ximo introduzido aleatoriamente para pong em servidores habilitados para ping, se <code>i2p.streaming.enablePongDelay</code> tamb\u00e9m estiver habilitada. A menos que seja definido explicitamente, o valor padr\u00e3o de 50ms ser\u00e1 utilizado.";
    t[9364] = "home";
    t[9365] = "inicio";
    t[9370] = "When in doubt, leave the settings at the defaults.";
    t[9371] = "Na d\u00favida, deixai as configura\u00e7\u00f5es no padr\u00e3o.";
