    t[9466] = "This may be a transient error, if the other program is no longer using the port.";
    t[9467] = "Este pode ser um erro passageiro, se o outro programa n\u00e3o estiver mais usando a porta.";
    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Seu roteador I2P+ por padr\u00e3o contribui para a rede, roteando o tr\u00e1fego criptografado interno e de ponta a ponta para outros roteadores, conhecidos como <i>participa\u00e7\u00e3o</i>. A participa\u00e7\u00e3o em largura de banda melhora o n\u00edvel de anonimato de todos os usu\u00e1rios na rede e maximiza sua velocidade de download.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Esta configura\u00e7\u00e3o permite a configura\u00e7\u00e3o de servidores NTP alternativos necess\u00e1rios para garantir que seu roteador mantenha a hora do rel\u00f3gio precisa. [O padr\u00e3o \u00e9 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Otimize suas imagens";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Observe que o criador de perfil depende do uso sustentado do t\u00fanel do cliente para criar o perfil dos pares com precis\u00e3o.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Se voc\u00ea est\u00e1 com pressa e n\u00e3o pode esperar algumas horas, voc\u00ea pode pedir \u00e0s pessoas para usarem um servi\u00e7o de redirecionamento de endere\u00e7o de \"salto\" (\"jump\"). Isso geralmente funcionar\u00e1 dentro de alguns minutos ap\u00f3s voc\u00ea registrar o nome do host no mesmo site. Teste voc\u00ea mesmo primeiro inserindo <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>seunomeescolhido.i2p</i></code> no seu navegador. Uma vez que estiver funcionando, voc\u00ea pode dizer aos outros para usarem isso.";
