    t[9580] = "Note that the full path to the output files must be accessible before deploying the filter. If the target directory does not exist, the destinations will not be recorded and an error will appear in the router logs. The files will be created as required. The examples provided above are not recommendations; your configuration should be tuned according to the amount of content (number and size of files) your site is serving, the speed of the server, and the frequency with which the site is updated. Configuring recorders and monitoring the resulting files will help you fine tune the settings.";
    t[9581] = "Observe que o caminho completo para os arquivos de sa\u00edda deve estar acess\u00edvel antes de implantar o filtro. Se o diret\u00f3rio de destino n\u00e3o existir, os destinos n\u00e3o ser\u00e3o registrados e um erro aparecer\u00e1 nos logs do roteador. Os arquivos ser\u00e3o criados conforme necess\u00e1rio. Os exemplos fornecidos acima n\u00e3o s\u00e3o recomenda\u00e7\u00f5es; a configura\u00e7\u00e3o deve ser ajustada de acordo com a quantidade de conte\u00fado (n\u00famero e tamanho de arquivos) que seu site est\u00e1 fornecendo, a velocidade do servidor e a frequ\u00eancia com que o site \u00e9 atualizado. Configurar gravadores e monitorar os arquivos resultantes ajudar\u00e1 a ajustar as configura\u00e7\u00f5es.";
    t[9588] = "In the Network Settings sub-section, hit the <i>Settings</i> button.";
    t[9589] = "Na subse\u00e7\u00e3o Configura\u00e7\u00f5es de rede, clique no bot\u00e3o <i>Configura\u00e7\u00f5es</i>.";
