    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "T\u00faneis constru\u00eddos por outros roteadores atrav\u00e9s do seu roteador. Isso pode variar muito dependendo da demanda da rede, largura de banda compartilhada e quantidade de tr\u00e1fego gerado localmente. O m\u00e9todo recomendado para limitar os t\u00faneis participantes \u00e9 alterar a porcentagem de compartilhamento na p\u00e1gina de configura\u00e7\u00e3o de largura de banda. Voc\u00ea tamb\u00e9m pode limitar o n\u00famero total definindo <code>router.maxParticipatingTunnels=nnn</code> na p\u00e1gina de configura\u00e7\u00e3o avan\u00e7ada. [Habilitar gr\u00e1ficos]";
