    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Para configurar um servidor web alternativo para uso no I2P, voc\u00ea pode usar o t\u00fanel do servidor web existente e <a href=/configclients>desabilitar o servidor web padr\u00e3o</a> da execu\u00e7\u00e3o, ou criar um novo t\u00fanel HTTP Server no <a href=/i2ptunnelmgr>Gestor de T\u00faneis</a>. Garanta que a <i>porta de escuta</i> do servidor web tamb\u00e9m esteja configurada nas defini\u00e7\u00f5es do Gestor de T\u00faneis. Por exemplo, se o seu servidor web est\u00e1 escutando por padr\u00e3o no endere\u00e7o 127.0.0.1 porta 80, voc\u00ea tamb\u00e9m precisa garantir que a <i>porta de destino</i> na p\u00e1gina de defini\u00e7\u00f5es do Gestor de T\u00faneis para o servi\u00e7o esteja configurada para a porta 80.";
