    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Normalmente, um roteador I2P s\u00f3 precisa ser reseeded uma vez, para se conectar \u00e0 rede pela primeira vez. No entanto, se o roteador estiver em execu\u00e7\u00e3o por um longo per\u00edodo sem conectividade de rede, ele tamb\u00e9m poder\u00e1 precisar ser reseeded. O reseed envolve o download de m\u00faltiplos arquivos \"RouterInfo\" (agrupados em um arquivo zip assinado) a partir de, no m\u00ednimo, duas URLs de servidores predefinidas selecionadas a partir de um grupo de servidores HTTPS da Clearnet mantidos por volunt\u00e1rios.";
    t[10050] = "Are you sure you want to delete {0}?";
