    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Uma lista de pa\u00edses derivados do <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>Relat\u00f3rio sobre Liberdade Mundial</a> com uma reputa\u00e7\u00e3o ruim em termos de liberdades civis. Essa lista \u00e9 usada para colocar os roteadores que executam nos pa\u00edses especificados no <i>Modo Oculto</i> para proporcionar maior seguran\u00e7a aos usu\u00e1rios. Os seguintes pa\u00edses s\u00e3o designados como restritos: Afeganist\u00e3o, Azerbaij\u00e3o, Barein, Bielorr\u00fassia, Brunei, Burundi, Camar\u00f5es, Rep\u00fablica Centro-Africana, Chade, China, Cuba, Rep\u00fablica Democr\u00e1tica do Congo, Egito, Guin\u00e9 Equatorial, Eritreia, Eti\u00f3pia, Ir\u00e3, Cazaquist\u00e3o, Laos, L\u00edbia, Mianmar, Coreia do Norte, Territ\u00f3rios Palestinianos, Ruanda, Ar\u00e1bia Saudita, Som\u00e1lia, Sud\u00e3o do Sul, Sud\u00e3o, Essuat\u00edni (Suazil\u00e2ndia), S\u00edria, Tajiquist\u00e3o, Tail\u00e2ndia, Turquia, Turcomenist\u00e3o, Venezuela, Emirados \u00c1rabes Unidos, Uzbequist\u00e3o, Saara Ocidental, I\u00eamen.";
