    t[10294] = "A limited selection of stats is enabled by default, required for monitoring router performance. Only stats that have an optional graph are listed here; for a full list of enabled stats, view the <a href=\"/stats\">stats page</a>.";
    t[10295] = "Uma sele\u00e7\u00e3o limitada de estat\u00edsticas \u00e9 ativada por padr\u00e3o, necess\u00e1ria para o monitoramento do desempenho do roteador. Somente estat\u00edsticas que possuem um gr\u00e1fico opcional est\u00e3o listadas aqui; Para uma lista completa das estat\u00edsticas ativadas, consulte a <a href=/stats>p\u00e1gina estat\u00edsticas</a>.";
