    t[10650] = "Duplicate packets received from peer";
    t[10651] = "Pacotes duplicados recebidos do peer";
    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "Os servi\u00e7os podem ser hospedados em v\u00e1rios roteadores simultaneamente, compartilhando a mesma chave privada para o destino. O multihoming pode aumentar ainda mais a seguran\u00e7a e a estabilidade de um servidor, oferecendo redund\u00e2ncia. Se um servidor tiver v\u00e1rias conex\u00f5es, quando um servidor na pool ficar offline, o servi\u00e7o fornecido permanecer\u00e1 dispon\u00edvel, dificultando a correla\u00e7\u00e3o do tempo de inatividade do servidor com a interrup\u00e7\u00e3o do roteador.";
    t[10672] = "Client Configuration";
    t[10673] = "Configura\u00e7\u00e3o de Clientes";
