    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Por padr\u00e3o, o I2P usar\u00e1 o navegador padr\u00e3o configurado no sistema para iniciar na inicializa\u00e7\u00e3o. Se desejar escolher um navegador alternativo, ser\u00e1 necess\u00e1rio editar o arquivo router.config (ou a <a href=/configadvanced>p\u00e1gina de Configura\u00e7\u00e3o Avan\u00e7ada</a> se voc\u00ea tiver habilitado o modo console avan\u00e7ado) e adicionar uma nova linha de configura\u00e7\u00e3o <code>routerconsole.browser=/path/to/browser</code> ou <code>routerconsole.browser=\\path\\to\\browser.ext</code> se estiver usando o Windows, substituindo <code>\\path\\to\\browser</code> pelo caminho do navegador que deseja usar. Observa\u00e7\u00e3o: Se o caminho para o navegador escolhido contiver espa\u00e7os, talvez seja necess\u00e1rio colocar o caminho entre aspas, por exemplo, <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
