    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "Uma aplica\u00e7\u00e3o web do I2P que gerencia destinos de servi\u00e7o para a rede, mapeando hashes B64 para nomes leg\u00edveis por humanos. Os destinos podem ser adicionados manualmente ou atrav\u00e9s de assinaturas de arquivos hosts.txt. Tamb\u00e9m conhecido como SusiDNS. Para mais informa\u00e7\u00f5es, consulte a <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>documenta\u00e7\u00e3o online</a>.";
