    t[11150] = "A tunnel to the main IRC server network within I2P, Irc2P, is created when I2P is installed (see the <a href=/i2ptunnelmgr>Tunnel Manager</a>), and is automatically started when the I2P router starts. To connect to it, tell your IRC client to connect to server: <code>127.0.0.1</code> port: <code>6668</code>.";
    t[11151] = "Um t\u00fanel para a rede principal do servidor IRC no I2P, Irc2P, \u00e9 criado quando o I2P \u00e9 instalado (consulte o <a href=/i2ptunnelmgr>Gerenciador de T\u00faneis</a>), e \u00e9 iniciado automaticamente quando o roteador I2P \u00e9 iniciado. Para se conectar a ele, informe ao seu cliente de IRC para se conectar ao servidor: <code>127.0.0.1</code> porta: <code>6668</code>.";
