    t[11230] = "Can be enabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If both http and https are enabled, automatic redirection to https is enabled by default. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[11231] = "Pode ser ativado no arquivo <code>clients.config</code>. Tamb\u00e9m pode ser configurado para se vincular a uma interface espec\u00edfica ou a todas as interfaces. Se tanto o http quanto o https estiverem habilitados, a redire\u00e7\u00e3o autom\u00e1tica para https estar\u00e1 ativada por padr\u00e3o. Se voc\u00ea tornar o Console do Roteador dispon\u00edvel na rede, talvez deseje <a href=/configui#passwordheading>aplicar uma senha de acesso</a> para evitar acesso n\u00e3o autorizado.";
