    t[11384] = "Click the <i>Start</i> button for your webserver tunnel on the <a href=/i2ptunnelmgr/>main Tunnel Manager page</a>. You should now see it listed under <i>Service Tunnels</i> on the <a href=/>Router Console</a> sidebar. A green star displayed next to the tunnel name (<i>I2P Webserver</i> by default) indicates that your website is active on the I2P network.";
    t[11385] = "Clique no bot\u00e3o <i>Iniciar</i> para o seu t\u00fanel de servidor web na <a href=/i2ptunnelmgr/>p\u00e1gina principal do Gerenciador de T\u00faneis</a>. Agora voc\u00ea deve v\u00ea-lo listado em <i>T\u00faneis de Servi\u00e7o</i> na barra lateral da <a href=/>Router Console</a>. Uma estrela verde exibida ao lado do nome do t\u00fanel (<i>I2P Webserver</i> por padr\u00e3o) indica que o seu website est\u00e1 ativo na rede I2P.";
