    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "Para usar um \u00fanico conjunto de t\u00faneis para v\u00e1rios servi\u00e7os de cliente, os clientes podem ser configurados no <i>Tunnel Manager</i> para operar no modo <i>Cliente Compartilhado</i>. Este modo economiza recursos e mistura o tr\u00e1fego de v\u00e1rios clientes em um \u00fanico conjunto de t\u00faneis, dificultando a an\u00e1lise de tr\u00e1fego. Clientes configurados como Clientes Compartilhados compartilham as mesmas op\u00e7\u00f5es de t\u00fanel.";
