    t[11588] = "This is the number of pending requests from other routers to build a participating tunnel through your router. It should usually be close to zero. If it is consistently high, your computer is too slow, and you should reduce your share bandwidth limits.";
    t[11589] = "Este \u00e9 o n\u00famero de solicita\u00e7\u00f5es pendentes de outros roteadores para construir um t\u00fanel participante atrav\u00e9s do seu roteador. Geralmente, deve ser pr\u00f3ximo de zero. Se estiver consistentemente alto, seu computador est\u00e1 muito lento e voc\u00ea deve reduzir os limites de largura de banda compartilhada.";
