    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Seu modem ou roteador pode suportar <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), que permite o redirecionamento autom\u00e1tico de portas. Verifique se o suporte do UPnP para o I2P+ est\u00e1 ativado na <a href=/confignet>p\u00e1gina de configura\u00e7\u00e3o</a>, em seguida, tente ativar o UPnP no seu modem/roteador e possivelmente tamb\u00e9m no seu computador. Agora tente reiniciar o <a href=/>roteador I2P+</a>. Se for bem-sucedido, o I2P+ deve mostrar \"Status: OK\" no painel lateral assim que o roteador I2P+ completar os testes iniciais de conectividade.";
