    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "I2P funciona mesmo atr\u00e1s de diversas paredes de fogo, mas a velocidade e integra\u00e7\u00e3o na rede podem melhorar se as portas UDP e TCP usadas pelo I2P estiverem redirecionadas.";
