    t[12020] = "Tunnels longer than 3 hops (for example 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), or a high quantity + backup quantity, may severely reduce performance or reliability.";
    t[12021] = "T\u00faneis com mais de 3 saltos (por exemplo 2 saltos + 0-2 saltos, 3 saltos + 0-1 saltos, 3 saltos + 0-2 saltos), ou alta quantidade + alta quantidade de backup, podem diminuir bastante a performance.";
