    t[12024] = "A router that facilitates the connection to the network of another router that is behind a firewall.";
    t[12025] = "Um roteador que facilita a conex\u00e3o com a rede de outro roteador que est\u00e1 atr\u00e1s de um firewall.";
    t[12026] = "I2P FAQ";
    t[12027] = "Perguntas frequentes sobre I2P";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Se voc\u00ea passar o mouse sobre o cabe\u00e7alho <i>Informa\u00e7\u00f5es do Roteador</i>, sua identidade de roteador truncada ser\u00e1 exibida (os primeiros quatro caracteres (24 bits) do seu hash de roteador de 44 caracteres (256 bits) em Base64). O hash completo \u00e9 mostrado em sua <a href='netdb?r=.'>entrada no Banco de Dados de Rede</a>. Nunca revele isso para ningu\u00e9m, pois sua identidade de roteador est\u00e1 vinculada exclusivamente ao seu endere\u00e7o IP no banco de dados de rede.";
    t[12030] = "Previous";
