    t[12033] = "Roteador parado";
    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "A listagem de diret\u00f3rios (\u00e0s vezes chamada de diret\u00f3rios virtuais) est\u00e3o ativadas por padr\u00e3o, ent\u00e3o voc\u00ea pode hospedar arquivos de um subdiret\u00f3rio de <code>docroot</code> sem fornecer uma p\u00e1gina com links para os arquivos. Voc\u00ea tamb\u00e9m pode servir conte\u00fado que existe fora de <code>docroot</code> usando um <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>link simb\u00f3lico</a> para o diret\u00f3rio desejado.";
