    t[12184] = "This setting determines the number of NetDb DHT buckets the Peer Exploration Job will reference when run. By default, the number of buckets to explore will vary depending on whether the router has been running for over an hour, if the router is hidden or in the 'K' bandwidth tier, and the number of known routers.";
    t[12185] = "Esta configura\u00e7\u00e3o determina o n\u00famero de buckets DHT do NetDb que o Job de Explora\u00e7\u00e3o de Pares far\u00e1 refer\u00eancia quando for executado. Por padr\u00e3o, o n\u00famero de buckets a serem explorados variar\u00e1 dependendo se o enrutador est\u00e1 funcionando h\u00e1 mais de uma hora, se o enrutador est\u00e1 oculto ou no n\u00edvel de largura de banda 'K' e do n\u00famero de enrutadores conhecidos.";
